INSERT INTO `t_cms` VALUES ('1650533799932493826', '关于强制平仓的说明', '•风险度是衡量您资产风睑的指标，当风险度等于100% 时，您的仓位被视为爆仓，风险度=（持仓保证金/合约帐 户权益）*100%，为了防止用户穿仓，系统设定了风险度 的调整比例，当风险度达到系统设定的风险值，系统将强 制平仓0\n\n•例如：系统设定的调整比例为10%，则当您的风险度大 于等于90%时，您的所有仓位都将会被系统强制平仓。\n\n•注：若是风险度超标导致的系统强制平仓，是将您所有 仓位都进行平仓，因此希望您可以合理的控制您的风险 度，以免因此造成不必要的损失。', '2023-04-25 00:14:58', 'help_center', 'zh-CN', 'help-011');
INSERT INTO `t_cms` VALUES ('1650806878443999233', '合约交易规则是什么？', '•交易类型\n\n买入做多（看涨），是指您认为当前指数有涨的可能，希望以您设定的价格或者当前市价，新买入一定数量的某种合约。\n\n卖出做空（看跌），是指您认为当前指数有跌的可能，您期望以您设定的价格或当前市价，新卖出一定数量的某种合约。\n\n•下单方式\n\n限价委托：您需要自己指定下单的价格和数量。\n\n市价委托：您只需设定下单的数量，价格为当前市场价格。\n\n•持仓\n当您提交的开仓委托单成交后，即称之为持仓。\n\n•合约交割问题：平台合约为永续合约，无设定交割时间。只要未达到系统爆仓条件或您未手动平仓，您可永久持仓。\n\n·系统平仓\n到止盈止损设定值，系统自动平仓。\n风险度过高，系统强制平仓。', '2023-04-25 18:20:05', 'help_center', 'zh-CN', 'help-02');
INSERT INTO `t_cms` VALUES ('1653116020816130050', '关于费率的说明', '合约交易费率|\n•合约交易开仓手续费：3%\n•合约交易平仓无需手续费\n\n充提交易费率|\n•提币手续费：2%\n•充币无需手续费\n\n其他费率说明|\n•账户划转/兑换无需手续费\n•币币买入无需手续费 币币卖出手续费：1%', '2023-05-02 03:15:47', 'help_center', 'zh-CN', 'help-03');
INSERT INTO `t_cms` VALUES ('1653116415462387714', '什么是限价委托和市价委托？', '·限价委托指的是：按照您的制定价格委托平台进行交易的价格。\n·市价委托指的是：委托平台直接以当前市场价格进行交易。\n·在开放交易规则中，市价订单优先于限价订单。如果您选择限价单，请根据当前货币市场价格合理开仓。', '2023-05-02 03:17:22', 'help_center', 'zh-CN', 'help-04');
INSERT INTO `t_cms` VALUES ('1660702964278439938', '资产中的折合金额为什么会产生变化', '·资产中折合计算的时当前持有数字货币折合美元的价值，因数字资产的价格产生波动而变化。您的数字资产数量并没有改变。', '2023-05-23 01:43:36', 'help_center', 'zh-CN', 'help-05');
INSERT INTO `t_cms` VALUES ('1660710455749980161', '什么是冻结资产?', '·冻结资产是指您在进行交易或提现操作时，流程未全部完成，当前资产暂时由系统托管，不能由您自由支配。并不代表您损失了这笔资产或资产出现异常，请您放心。', '2023-05-23 02:13:22', 'help_center', 'zh-CN', 'help-06');
INSERT INTO `t_cms` VALUES ('1660720657446547457', '期货交易的规则是什么？', '·通过预估当前交易对接下来的价格走势（涨跌）的方式参与交易，结算时不计算涨跌的幅度，只对涨跌的结果进行收益结算。\n·不同交割时间结算的盈利百分比不同，盈利将准确的展示在交易界面中。', '2023-05-23 02:53:54', 'help_center', 'CN', 'help-07');
INSERT INTO `t_cms` VALUES ('1660721104253169666', 'What are the rules of futures trading?', '• Participate in the transaction by estimating the current transaction to the next price trend (ups and downs), and the range of ups and downs is not calculated during the settlement, and only the results of the ups and downs are settled in revenue.\n• The profit percentage settled at different delivery times is different, and the profit will be accurately displayed in the trading interface.', '2023-05-23 02:55:41', 'help_center', 'en', 'help-01-en');
INSERT INTO `t_cms` VALUES ('1660721563311353857', 'What is frozen assets?', '• Freezing assets means that the process is not fully completed when you conduct transactions or withdrawal operations. The current assets are temporarily managed by the system and cannot be freely controlled by you. It does not mean that you have lost this asset or that the asset is abnormal.', '2023-05-23 02:57:30', 'help_center', 'en', 'help-02-en');
INSERT INTO `t_cms` VALUES ('1661433661783904257', 'Why does the converted amount in assets change?', '• The conversion of assets is the value of the current digital currency held in dollars, which changes due to fluctuations in the price of digital assets. The number of your digital assets has not changed.', '2023-05-25 02:07:08', 'help_center', 'en', 'help-03-en');
INSERT INTO `t_cms` VALUES ('1661752093259595777', 'What are limit orders and market orders?', '• Limit order refers to ： Entrust platform to trade at the price you specify\n• Market order refers to: the entrusted platform directly trades at the current market price.\n• In open trading rules,The system will prioritize market orders. If you choose a limit order, please open the position reasonably based on the current currency market price.', '2023-05-25 23:12:28', 'help_center', 'en', 'help-04-en');
INSERT INTO `t_cms` VALUES ('1661752371035766785', 'Notes on forced liquidation', '• The degree of risk is an indicator to measure the risk of your assets. When the degree of risk is equal to 100%, your position is regarded as a liquidation. The degree of risk = (holding margin / contract account equity) * 100%. The adjustment ratio of risk degree is set. When the risk degree reaches the risk value set by the system, the system will force liquidation.\n• For example, if the adjustment ratio set by the system is 10%, when your risk level is greater than or equal to 90%, all your', '2023-05-25 23:13:34', 'help_center', 'en', 'help-05-en');
INSERT INTO `t_cms` VALUES ('1661753078711320578', 'What are the rules of contract trading?', '• Transaction Type\nBuying long (bullish) means that you think that the current index is likely to rise, and you want to buy a certain number of certain contracts at the price you set or the current market price.\n\nSelling short (bearish) means that you think that the current index is likely to fall, and you expect to sell a certain number of certain contracts at the price you set or the current market price.\n• Order method\n\nLimit order: You need to specify the price and quantity of the order.\n\nMa', '2023-05-25 23:16:23', 'help_center', 'en', 'help-06-en');
INSERT INTO `t_cms` VALUES ('1675829513193381889', 'About handling fees', 'Futures trading rates |\n• Futures trading fee: 2%\nContract rate |\n• Contract transaction opening fee: 3%\n• Contract margin ratio: 0.25%\n• No transaction fees for contract closing\nCurrency transaction rate |\n• Withdrawal fee: 1%\n• No charge for deposit\nDeion of other rates |\nNo transfer fees for account transfer / exchange', '2023-07-03 19:31:06', 'help_center', 'en', 'help-07-en');
INSERT INTO `t_cms` VALUES ('1677666650427527170', '用户协议', '</br>我们在此特别提醒您：\n</br>\n</br>1 数字资产本身不由任何金融机构或公司或本网站发行；\n</br>2 数字资产市场是全新的、未经确认的，而且可能不会增长；\n</br>3 数字资产主要由投机者大量使用，零售和商业市场使用相对较少，数字资产交易存在极高风险，其全天不间断交易，没有涨跌限制，价格容易受庄家、全球政府政策的影响而大幅波动；\n</br>4 如果公司根据其单方判断认为您违反了本协议，或者根据您所在管辖区域的法律本网站提供的服务或者您使用本网站提供的服务的行为是非法的，公司有权随时暂停或终止您的账户，或者暂停或终止您使用本网站提供的服务或数字资产交易。 禁止位于美国、日本的任何人使用本网站提供的服务。\n</br>数字资产交易有极高风险，并不适合绝大部分人士。您了解和理解此交易有可能导致部分损失或全部损失，所以您应该以能承受的损失程度来决定交易的金额。您了解和理解数字资产会产生衍生风险，所以如有任何疑问，建议先寻求专业顾问的协助。此外，除了上述提及过的风险以外，还会有未能预测的风险存在。您应慎重考虑并用清晰的判断能力去评估自己的财政状况及上述各项风险而作出任何买卖数', '2023-07-08 21:11:14', 'system', 'zh-CN', '001');
INSERT INTO `t_cms` VALUES ('1677666921161461762', 'Инструкции по депозиту', '· Текст описания, пожалуйста, не пополняйте счет активов, не относящихся к USDT-ERC20, на указанный выше адрес, пока вы его не измените, иначе бонус актива не может быть получен. <br>\n· Если вы завершили внесение депозита, нажмите кнопку \"Я сделал депозит\" на странице и отправьте квитанцию, в противном случае депозит не может быть опубликован. <br>\n· Депозит в USDT поддерживает только простой метод отправки, и депозит с использованием других методов (отправить все) временно не может быть отправл', '2023-07-08 21:12:18', 'info', 'ru', '002');
INSERT INTO `t_cms` VALUES ('1677667256705781762', '充币说明', '</br>\n·如果您已完成存款，请点击页面上的“我已存款”按钮并提交收据，否则存款无法过帐。\n</br>\n·USDT充值仅支持简单发送方式，其他方式（全部发送）充值暂时无法过账。 敬请谅解。\n</br>\n·您向上述地址充值后，需要确认全网络节点后才能到账。\n</br>\n·请确保您的计算机和浏览器安全，防止信息被篡改或泄露。\n</br>\n·以上充值地址为平台官方收款地址，请认准平台官方充值地址，因充值错误造成的资金损失需自行承担\n</br>', '2023-07-08 21:13:38', 'info', 'zh-CN', '002');
INSERT INTO `t_cms` VALUES ('1677667446858747906', '提币说明', '·提币时间为24小时。 <br>\n·目前提币只支持USDT币种。<br>\n·提交提币申请后，该笔资金属于冻结状态是因为提现正在进行中，该笔资金暂时由系统托管，并不代表您损失了这笔资产或资产出现异常。 <br>\n·提交提币申请后12h内到账，如预计提币时间后未到账请咨询在线客服。', '2023-07-08 21:14:24', 'info', 'zh-CN', '003');
INSERT INTO `t_cms` VALUES ('1677743322292027394', '提币说明', '<br>1: Withdrawal time is 24 hours.\n<br>2: At present, the withdrawal only supports USDT currency.\n<br>3: After submitting the withdrawal request, the funds are in a frozen state because the withdrawal is in progress and the funds are temporarily managed by the system. It does not mean that you have lost this asset or the asset is abnormal.\n<br>4: Arrival within 12 hours after submitting the withdrawal request. If you do not arrive after the expected withdrawal time, please consult the online cu', '2023-07-09 02:15:54', 'info', 'en', '003');
INSERT INTO `t_cms` VALUES ('1677743555675684866', '提币说明', '·24시간 코인 인출 가능.<br>\n·현재 인출은 USDT 만 지원됩니다. <br>\n·코인 인출 신청 후, 이 자금은 동결 상태로써 현금인출이 진행 중이기에 당분간은 시스템 호스팅을 받게 됩니다. 이는 자산 분실 또는 자산 비정상을 의미하지 않습니다. <br>\n·출금 신청 후 12 시간 이내에 계좌가 입금되며, 출금 예정 시간이 지나도 입금되지 않을 경우 온라인 고객 센터로 연락 주시기 바랍니다.', '2023-07-09 02:16:49', 'info', 'Korean', '003');
INSERT INTO `t_cms` VALUES ('1679920848435269634', '关于我们', '关于我们\n\nJPEX 数字资产银行\n\n持牌USDT交易所｜比特币交易所 | 以太币交易所JPEX数字资产银行是一间持牌，并受认可的数字资产、虚拟货币平台。 JPEX旨在提供安全可靠的国际买币平台，让大家在不同地方都可以安全便利地进行加密货币买卖，不论是泰达币买卖 (usdt 买卖)、比特币买卖 (btc 买卖)、以太币买卖 (eth买卖)，还是其他虚拟货币。\n\n\n\nJPEX – 您的虚拟货币平台\n\n\n\n目前JPEX营运总部设立在杜拜，杜拜作为中东的金融枢纽，是唯一拥有独立监管环境的全球经济体，其新设立虚拟资产监管局（VARA）受国际法规框架约束，在 VARA 的监管下，JPEX所设立的交易系统更具严格监管标准，跨境交易更具透明度，从而确保全球市场完整性。\n\n\n\nJPEX 自2020年7月以来，一直致力于为所有人服务，为大众提供安全可靠的买币平台。由专注亚太区的服务开始，担任大众可靠并受不同国家认可的usdt 交易所、比特币交易所、以太币交易所（eth交易平台）等加密货币的交易平台，提供专业的泰达币买卖 (usdt 买卖)、比特币买卖 (btc 买卖)、以太币买卖 (eth买卖)等买卖服务。让不同地区人士都可以安心入手买币，进入新世界的资产及货币市场。\n\n\n\n除了第一步针对亚太区市场提供高质量的买币平台交易环境外，我们还希望将JPEX 虚拟货币平台推广到世界各地；除了在首选国家/地区申请合规许可证外，我们还向美国金融机构申请加密的银行数字许可证。经过两个月的财务部门申请和批准，该许可证现已正式获得。\n\n\n\n另外，JPEX 是提供多种币种买卖的虚拟货币平台，使用者可以在JPEX 进行不同的加密货币买卖服务，例如泰达币买卖 (usdt 买卖)、比特币买卖 (btc 买卖)、以太币买卖 (eth买卖)等。在满足大家对买币的需求的同时，方便大家统一管理，无须分别寻找usdt 交易所、比特币交易所、以太币交易所 （eth交易平台）等不同的买币平台。\n\n\n\n将来，我们希望将JPEX 平台扩展到世界各地，并提供更好的虚拟货币平台交易服务和银行服务，希望您能继续支持我们并提供更多意见，从而使我们变得更好并朝着实现这一目标迈进。成为除了亚洲地区上的领头，即最好的香港usdt交易所、台湾usdt交易所和日本usdt交易所外，亦同样是放眼全球最安全可靠的usdt 交易所、比特币交易所和以太币交易所 （eth交易平台）。\n\n\n\n成为世界上五个最大的交易所，担任包括「usdt 交易所」、「比特币交易所」和「以太币交易所」（eth交易平台）板块的第一，将会继续推动我们优化我们的平台，为平台使用者提供更优质贴心的服务。\n\n\n\nJPEX – 专业的团队 保障您的买币平台\n\n\n\nJPEX 以区块链及加密货币为主要业务，致力打造安全的买币平台。团队中的人员均来自日本，美国及中国三地顶级电脑技术专业人员，顾问团队曾为美国前华尔街大型对冲基金公司服务。\n\n\n\nJPEX 营运总部在杜拜，同时在不同国家设立相应部门，包括美国 JPEX (United States) 主要为策略顾问，JPEX (Australia) 主要为市场推广，JPEX (Canada) 则主要为发展路线规划。\n\n\n\n我们集合不同地方的人才，打造专业且安全的虚拟货币平台，在不同地方都成为不同币种的一流买币平台。让JPEX 同时成为可靠的「香港usdt交易所」、「台湾usdt交易所」和「以太币交易所」（eth交易平台）等。\n\n\n\nJPEX 数字资产银行持有的虚拟货币平台相关牌照：\n\n\n\n（1） 成功获得加拿大MSB Fintrac 牌照\n\n\n\n加拿大 Fintrac MSB 牌照是由 FINTRAC (加拿大金融交易和报告分析中心)监管并颁发的一类金融牌照。加拿大MSB 监管是货币交易和货币兑换服务类型企业，必须向央行进行申请并且进行备案监督，此类型公司同时还必须受加拿大财政部直属的金融交易和报告分析(FINTRAC)实时监控数据,并且对议会活动中心负责，以保证国家金融安全。\n\n\n\nJPEX 已经获取相关牌照，是获得加拿大FINTRAC认可的虚拟货币平台，提供安全，并受认可的买币平台服务。 JPEX (Canada) 主要负责规划JPEX未来发展路线，并且与加拿大当地金融团队合作拟定重要决策。若想查询JPEX 的加拿大MSB Fintrac 牌照可以按照下列方式：\n\n \n\n查询网址 : https://www10.fintrac-canafe.gc.ca/msb-esm/public/msb-search/search-by-name/\n\n\n\n查询方式 : 于 “Search By Name” 输入 JP-EX\n\n\n\n（2） 成功申请美国FinCEN颁发的MSB金融许可证\n\n\n\n美国MSB（货币服务业务）许可证是由FinCEN（美国财政部下属机构金融犯罪执法局）监管和发行的金融许可证，主要监管对像是与货币服务有关的企业和公司。包括国际汇款，外汇，货币交易/转移（包括数字货币/虚拟货币），ICO发行，预付款项的提供以及旅行支票的发行。\n\n\n\n针对虚拟货币平台的指引，FinCEN于2013年3月18日发布了“ FinCEN法规在管理，交换或使用虚拟货币的人员中的应用”，该指南阐明了公司和个人在MSB注册中使用虚拟货币的要求。 MSB是货币服务业务的缩写。它由美国财政部下属机构FinCEN（金融犯罪执法局）管理，属于注册许可系统，所有与货币服务有关的业务都必须申请此许可。\n\n\n\n而JPEX 作为负责任的虚拟货币平台，为保障公众和买币平台的安全，已成功获得相关许可证。因此，JPEX 是受美国FinCEN认可的专业虚拟货币平台，是可以信任的受监管虚拟货币平台。 JPEX (United States) 担任策略顾问角色，并与当地发展规模成熟的区块链技术企业共同探索区块链领域。无论是想寻找usdt 交易所、比特币交易所、以太币交易所 (eth交易平台)等不同币种的买币平台，都可以透过JPEX 进行。若想查询JPEX 的美国MSB 金融许可证可以按照下列方式：\n\n\n\n查询网址 : https://www.fincen.gov/msb-state-selector\n\n\n\n（3） 获ASIC颁发营运执照的企业\n\n\n\n澳大利亚是世界领先的核心金融市场，同时亦是世界上增长最快的衍生品交易市场之一，是一个完全成熟且监管良好的资本市场。当地金融部门的常规基础设施设备良好，因而构成了保证金产品市场。\n\n\n\nJPEX (Australia) 担当市场推广的角色，于2022年首季已赞助三支澳职联球队及在第四季会开设“Metaverse-Lab”研发部门，积极与澳洲本地大学及区块链公司共同探讨元宇宙、Web3.0和人工智能等领域。\n\n\n\n大家可以透过澳大利亚政府批准ASIC查询链接，查询JPEX ( JP-EX CRYPTO ASSET PLATFORM PTY LTD) 的执业证。\n\n查询网址 : https://abr.business.gov.au\n\nACN注册编号：644625650\n\n\n\n为何选择JPEX 虚拟货币平台\n\n\n\n服务为本的智能买币平台\n\n\n\nJPEX 专注服务，我们以用户利益为依归，全力打造划时代以服务为本的世界级虚拟货币平台。我们先是专注亚洲地区生态布局，设立先进智能交易中心，为用户提供升级的买币平台。\n\n\n\n安全可靠的买币平台\n\n\n\n同时，我们亦着力针对公众对虚拟货币平台的忧虑，提升买币平台和买币过程的安全性，以超过20年的安全可靠的价值网络服务经验，利用金融交易及管理经验企业级分布式架构，防御DDOS攻击系统。\n', '2023-07-15 02:28:36', 'system', 'zh-CN', '020');
INSERT INTO `t_cms` VALUES ('1679921207648047105', '关于我们', 'About Us\nAbout JPEX Digital Asset Bank:\n\nLicensed USDT Exchange | Bitcoin Exchange | Ethereum Exchange\n\n\n\n\n\n\n\nJPEX Digital Asset Bank is a licensed and recognized platform to facilitate the trading of digital asset and virtual currency. JPEX aims to provide a safe and reliable international currency buying platform, with the intention of providing everyone an environment where they can safely and conveniently buy and sell cryptocurrencies in different places, whether it is Tether trading (USDT trading), Bitcoin trading (BTC trading), Ethereum trading (ETH buying and selling), or other virtual currencies.\n\n\n\nJPEX - Your virtual currency platform\n\n\n\nAt present, the JPEX operating headquarters is located in Dubai. As the financial hub of the Middle East, Dubai is the only global economy with an independent regulatory environment. Its newly established Virtual Assets Regulatory Authority (VARA) is bound by the international regulatory framework. Under the supervision of VARA, The trading system established by JPEX has stricter regulatory standards and more transparency and openness in cross-border transactions, thereby ensuring the integrity of the global market.\n\n\n\nSince July 2020, JPEX has been committed to serving everyone, and providing the public with a safe and reliable platform for buying coins. The service started focusing on the Asia-Pacific region, serving as a trading platform for the public\'s reliable and recognized cryptocurrency exchanges, such as USDT exchanges, Bitcoin exchanges, and Ethereum exchanges (eth trading platforms), providing professional Tether trading (USDT trading), Bitcoin trading (BTC trading), Ethereum trading (eth trading) and other trading services. People from different regions can buy coins with a peace of mind, and enter the asset and currency markets of the new world.\n\n\n\nIn addition to the first step of offering a superior trading platform for the Asia-Pacific market, we also hope to promote the JPEX virtual currency platform to all parts of the world. Not only will we be applying for compliance licenses in the preferred countries/regions, we will also apply to the US financial Institutions for encrypted bank digital licenses. After two months of the application and approval process by the financial department, the license has now been officially obtained.\n\n\n\nMoreover JPEX is a virtual currency platform that provides multi-currency trading. Users can manage different cryptocurrency trading services on JPEX , such as Tether currency trading (usdt trading), Bitcoin trading (btc trading), and Ethereum trading (eth trading). This offers a convenient solution for everyone to manage them in a single platform; there is no need to search for different buying platforms such as USDT exchanges, Bitcoin exchanges, and Ethereum exchanges (eth trading platforms).\n\n\n\nIn the future, we hope to expand the JPEX platform to all parts of the world, and provide enhanced virtual currency platform transaction services and banking services. We hope you can continue to support us and provide us with your valuable suggestions and insights, for us to become stronger to achieve this goal. We aim to become the leader in the Asian region, namely the best Hong Kong USDT exchange, Taiwan USDT exchange and Japan USDT exchange, and also the world\'s most secure and reliable USDT exchange, Bitcoin exchange and Ethereum exchange (eth trading platform).\n\n\n\nWe strive to become the world’s five largest exchanges, serving as leading in the “USDT exchange”, “Bitcoin exchange” and “Ethereum exchange” (eth trading platform) sectors. We will continue to optimize our platform in order to provide our platform users with heightened quality and first-rate services.\n\n\n\nJPEX - Professional team to safeguard your coin buying platform\n\n\nJPEX focuses on blockchain and cryptocurrency as its main business, and is committed to creating a secure currency exchange platform. The members of the team are all top technology professionals from Japan, the United States, and China. Furthermore, the consultant team has worked in the former large Wall Street hedge fund company in the United States.\n\n\n\nJPEX\'s operating headquarters is in Dubai, and corresponding departments are set up in different countries, including the United States. JPEX (United States) is mainly for strategic consultants, JPEX (Australia) is mainly for marketing, and JPEX (Canada) is mainly for route planning for development.\n\n\n\nWe gather talents from different areas to build a professional and secure virtual currency platform, which has become a first-class currency buying platform for different currencies in different places. This allows JPEX to become a reliable \"Australian USDT exchange\", \"Hong Kong USDT exchange\" and \"Ethereum exchange\" (eth trading platform) at the same time.\n\n\n\nVirtual currency platform related licenses held by JPEX Digital Asset Bank:\n\n\n\n（1） Successfully obtained the Canadian MSB Fintrac license\n\n\n\nThe Canadian Fintrac MSB license is a type of financial license supervised and issued by FINTRAC (Canadian Financial Transaction and Reporting Analysis Center). Canadian MSB is a supervision entity that overseeing enterprises that offer services including currency transaction and currency exchange. Activities of this type of company must be under the supervision of the central bank. They must also be subject to the real time data monitor from Financial Transaction and Reports Analysis Center (FINTRAC) that is directly under the Canadian Ministry of Finance for ensuring national financial security.\n\n\n\nJPEX has obtained relevant licenses and is approved by FINTRAC in Canada, to provide secure and recognized currency buying platform services. JPEX (Canada) is mainly responsible for planning the future development route of JPEX, and working with the local Canadian financial team to formulate important decisions. If you want to inquire about the Canadian MSB Fintrac license of JPEX , you can access the following:\n\n\n\nRead more online: https://www10.fintrac-canafe.gc.ca/msb-esm/public/msb-search/search-by-name/\n\n\n\nQuery method: Enter JP-EX in \"Search By Name\"\n\n\n\n（2） Successfully applied for the MSB financial license issued by FinCEN in the United States\n\n\n\nThe US MSB (Money Service Business) license is a financial license supervised and issued by FinCEN (Financial Crime Enforcement Bureau, a subsidiary of the US Treasury Department). The main regulatory matters are companies related to money services, which includes international remittance, foreign exchange, currency transaction/transfer (including digital currency/virtual currency), ICO issuance, and the provision of advance payment and issuance of travelers’ checks.\n\n\n\nOn March 18, 2013, FinCEN issued guidelines for cryptos exchange platforms regarding \"The Application of FinCEN Regulations to Persons Who Manage, Exchange or Use Virtual Currency\". This guideline clarifies the requirements of virtual currency in MSB registration by companies and individuals. It is managed by FinCEN and belongs to the registration licensing system. All businesses related to currency services must apply for this license.\n\n\n\nAs a responsible virtual currency platform, JPEX has successfully obtained relevant licenses to protect the safety of the public and the platform. Therefore, JPEX is a professional virtual currency platform recognized by FinCEN in the United States and a trusted and regulated virtual currency platform. JPEX (United States) acts as a strategic advisor and explores the blockchain field together with local mature blockchain technology companies. Whether you are looking for a platform to buy coins in different currencies, such as USDT exchange, Bitcoin exchange, ETH exchange, you can use JPEX . If you want to check JPEX \'s US MSB financial license, you can access the following:Read more online: https://www.fincen.gov/msb-state-selector\n\n\n\n（3） Businesses licensed by ASIC\n\n\n\nAustralia is the world\'s leading core financial market and one of the fastest-growing derivatives trading markets in the world. It is a fully mature and well-regulated capital market. The conventional infrastructure equipment of the local financial sector is reputable, which constitutes the market for margin products. \n\n\n\nJPEX (Australia) plays the role of marketing. It has sponsored three AFL teams in the first quarter of 2022 and will open a \"Metaverse-Lab\" R&D headquarter in the fourth quarter, actively working with local Australian universities and blockchain companies, exploring areas such as the Metaverse, Web 3.0, and Artificial Intelligence.\n\n\n\nYou can check the JPEX license through the ASIC query link approved by the Australian government.\n\n\n\nCheck online: https://abr.business.gov.au\n\n\n\nTrading platform registration number: 644625650\n\n\n\nWhy choose JPEX virtual currency platform\n\n\n\nA service-oriented smart currency buying platform\n\n\n\nJPEX focuses on providing service, and we are committed to building a service-oriented first-class virtual currency platform that benefits the interests of users. We first focused on establishing an advanced intelligent trading center in the Asian region to provide users with an efficient platform for buying coins.\n\n\n\nA secure and trustworthy platform for buying coins\n\n\n\nWe are also focused on improving the security of the coin buying platform, and the process of buying coins in response to the public\'s worries about the virtual currency platform. With more than 20 years of safe and reliable network service experience, we use financial transactions and management experience in enterprise-level distributed architecture to defend DDoS attacks.', '2023-07-15 02:30:02', 'system', 'en', '020');
