ure currency exchange platform. The members of the team are all top technology professionals from Japan, the United States, and China. Furthermore, the consultant team has worked in the former large Wall Street hedge fund company in the United States.\n\n\n\nJPEX\'s operating headquarters is in Dubai, and corresponding departments are set up in different countries, including the United States. JPEX (United States) is mainly for strategic consultants, JPEX (Australia) is mainly for marketing, and JPEX (Canada) is mainly for route planning for development.\n\n\n\nWe gather talents from different areas to build a professional and secure virtual currency platform, which has become a first-class currency buying platform for different currencies in different places. This allows JPEX to become a reliable \"Australian USDT exchange\", \"Hong Kong USDT exchange\" and \"Ethereum exchange\" (eth trading platform) at the same time.\n\n\n\nVirtual currency platform related licenses held by JPEX Digital Asset Bank:\n\n\n\n（1） Successfully obtained the Canadian MSB Fintrac license\n\n\n\nThe Canadian Fintrac MSB license is a type of financial license supervised and issued by FINTRAC (Canadian Financial Transaction and Reporting Analysis Center). Canadian MSB is a supervision entity that overseeing enterprises that offer services including currency transaction and currency exchange. Activities of this type of company must be under the supervision of the central bank. They must also be subject to the real time data monitor from Financial Transaction and Reports Analysis Center (FINTRAC) that is directly under the Canadian Ministry of Finance for ensuring national financial security.\n\n\n\nJPEX has obtained relevant licenses and is approved by FINTRAC in Canada, to provide secure and recognized currency buying platform services. JPEX (Canada) is mainly responsible for planning the future development route of JPEX, and working with the local Canadian financial team to formulate important decisions. If you want to inquire about the Canadian MSB Fintrac license of JPEX , you can access the following:\n\n\n\nRead more online: https://www10.fintrac-canafe.gc.ca/msb-esm/public/msb-search/search-by-name/\n\n\n\nQuery method: Enter JP-EX in \"Search By Name\"\n\n\n\n（2） Successfully applied for the MSB financial license issued by FinCEN in the United States\n\n\n\nThe US MSB (Money Service Business) license is a financial license supervised and issued by FinCEN (Financial Crime Enforcement Bureau, a subsidiary of the US Treasury Department). The main regulatory matters are companies related to money services, which includes international remittance, foreign exchange, currency transaction/transfer (including digital currency/virtual currency), ICO issuance, and the provision of advance payment and issuance of travelers’ checks.\n\n\n\nOn March 18, 2013, FinCEN issued guidelines for cryptos exchange platforms regarding \"The Application of FinCEN Regulations to Persons Who Manage, Exchange or Use Virtual Currency\". This guideline clarifies the requirements of virtual currency in MSB registration by companies and individuals. It is managed by FinCEN and belongs to the registration licensing system. All businesses related to currency services must apply for this license.\n\n\n\nAs a responsible virtual currency platform, JPEX has successfully obtained relevant licenses to protect the safety of the public and the platform. Therefore, JPEX is a professional virtual currency platform recognized by FinCEN in the United States and a trusted and regulated virtual currency platform. JPEX (United States) acts as a strategic advisor and explores the blockchain field together with local mature blockchain technology companies. Whether you are looking for a platform to buy coins in different currencies, such as USDT exchange, Bitcoin exchange, ETH exchange, you can use JPEX . If you want to check JPEX \'s US MSB financial license, you can access the following:Read more online: https://www.fincen.gov/msb-state-selector\n\n\n\n（3） Businesses licensed by ASIC\n\n\n\nAustralia is the world\'s leading core financial market and one of the fastest-growing derivatives trading markets in the world. It is a fully mature and well-regulated capital market. The conventional infrastructure equipment of the local financial sector is reputable, which constitutes the market for margin products. \n\n\n\nJPEX (Australia) plays the role of marketing. It has sponsored three AFL teams in the first quarter of 2022 and will open a \"Metaverse-Lab\" R&D headquarter in the fourth quarter, actively working with local Australian universities and blockchain companies, exploring areas such as the Metaverse, Web 3.0, and Artificial Intelligence.\n\n\n\nYou can check the JPEX license through the ASIC query link approved by the Australian government.\n\n\n\nCheck online: https://abr.business.gov.au\n\n\n\nTrading platform registration number: 644625650\n\n\n\nWhy choose JPEX virtual currency platform\n\n\n\nA service-oriented smart currency buying platform\n\n\n\nJPEX focuses on providing service, and we are committed to building a service-oriented first-class virtual currency platform that benefits the interests of users. We first focused on establishing an advanced intelligent trading center in the Asian region to provide users with an efficient platform for buying coins.\n\n\n\nA secure and trustworthy platform for buying coins\n\n\n\nWe are also focused on improving the security of the coin buying platform, and the process of buying coins in response to the public\'s worries about the virtual currency platform. With more than 20 years of safe and reliable network service experience, we use financial transactions and management experience in enterprise-level distributed architecture to defend DDoS attacks.', '2023-07-15 14:47:46', 'system', 'de', '01');
INSERT INTO `t_cms` VALUES ('1682755351834886145', 'Deposit instructions', '  </br>\n·If you have completed the deposit, please click the \\\"I have deposited\\\" button on the page and submit the receipt, otherwise the deposit cannot be posted. \n</br>\n·USDT deposit only supports the simple send method, and the deposit using other methods (send all) cannot be posted temporarily. Please understand. \n</br>\n·After you recharge to the above address, you need to confirm the entire network node before it can be credited. \n</br>\n·Please make sure that your computer and browser are safe to prevent information from being tampered with or leaked. \n</br>\n·The above deposit address is the official payment address of the platform, please look for the official deposit address of the platform, and the loss of funds caused by incorrect deposit shall be beared by yourself\n</br>\n\n', '2023-07-22 22:11:55', 'info', 'en', '002');
INSERT INTO `t_cms` VALUES ('1690380005609074690', 'User Agreement', 'Important reminder: We hereby remind you that:\n</br>\n</br>1. The digital assets themselves are not offered by any financial institution, corporation or this Website;\n</br>2. The digital asset market is new and unconfirmed, and will not necessarily expand;\n</br>3. Digital assets are primarily used by speculators, and are used relatively less on retail and commercial markets; digital asset transactions are highly risky, due to the fact that they are traded throughout the day without limits on the rise or fall in price, and market makers and global government policies may cause major fluctuations in their prices;\n</br>4. The Company may suspend or terminate your account or use of the Service, or the processing of any digital asset transaction, at any time if it determines in its sole discretion that you have violated this Agreement or that its provision or your use of the Service in your jurisdiction is unlawful. USE OF THE SERVICE BY PERSONS LOCATED IN THE UNITED STATES OF AMERICA AND JAPAN IS PROHIBITED.\n</br>Digital assets trading is highly risky and therefore not suitable for the vast majority of people. You acknowledge and understand that investment in digital assets may result in partial or total loss of your investment and therefore you are advised to decide the amount of your investment on the basis of your loss-bearing capacity. You acknowledge and understand that digital assets may generate derivative risks. Therefore, if you have any doubt, you are advised to seek assistance from a financial adviser first. Furthermore, aside from the above-mentioned risks, there may also be unpredictable risks. Therefore, you are advised to carefully consider and use clear judgment to assess your financial position and the abovementioned risks before making any decisions on buying and selling digital assets; any and all losses arising therefrom will be borne by you and we shall not be held liable in any manner whatsoever.\n</br>\n</br>You are hereby informed that:\n</br>\n</br>1. You understand that this Website is only intended to serve as a venue for you to obtain digital asset information, find trading counterparties, hold negotiations on and effect transactions of digital assets. This Website does not participate in any of your transactions, and therefore you shall, at your sole discretion, carefully assess the authenticity, legality and validity of relevant digital assets and/or information, and solely bear the responsibilities and losses that may arise therefrom.\n</br>2. All opinions, information, discussions, analyses, prices, advice and other information on this Website are general market reviews and do not constitute any investment advice. We do not bear any loss arising directly or indirectly from reliance on the abovementioned information, including but not limited to, any loss of profits.\n</br>3. The content of this Website may be changed from time to time and at any time without notice, and we have taken reasonable measures to ensure the accuracy of the information on the Website; however, we do not guarantee the degree of such accuracy, or bear any loss arising directly or indirectly from the information on this Website or from any delay or failure caused by failure to link up with the internet, transmit or receive any notice and information\n</br>4. Using internet-based trading systems also involves risks, including but not limited to failures in software, hardware or Internet links, etc. In view of the fact that we cannot control the reliability and availability of the Internet, we will not be responsible for any distortion, delay and link failure.\n</br>5. t is prohibited to use this Website to engage in any illegal transaction activities or illegitimate activities, such as money laundering, smuggling and commercial bribery. In the event that any suspected illegal transaction activities or illegitimate activities is uncovered, this Website will adopt all available measures, including but not limited to freezing the offender’s account, notifying relevant authorities, etc., and we will not assume any of the responsibilities arising therefrom and reserve the right to hold relevant persons accountable;\n</br>6. It is prohibited to use this Website for the purpose of malicious manipulation of the market, improper transactions or any other illicit trading activities. Where any of such illicit trading activities is uncovered, this Website will adopt such preventive and protective measures as warning, restricting trading and closing accounts against any and all such malicious manipulation of prices, maliciously influencing the trading system and any other illicit behaviors; we do not assume any of the responsibilities arising therefrom and reserve the right to hold relevant persons accountable.\n</br>\n</br>1.General Provisions\n</br>1.1 The User Agreement (hereinafter referred to as \"this Agreement\" or \"these terms and conditions\") consists of the main body, Terms of Privacy, Understanding Your client and Anti-money-laundering Policy, as well as any rules, statements, instructions, etc. that this Website has published or may publish in the future.\n</br>1.2 Before using the services offered by this Website, you shall read this Agreement carefully, and consult a professional lawyer if you have any doubt or as may be otherwise necessary. If you do not agree to the terms and conditions of this Agreement and/or any change made thereto from time to time and at any time, please immediately stop using the service provided by this Website or stop logging onto this Website. Upon your logging into this Website or using any service offered by this Website or engaging in any other similar activity, it shall be deemed as having understood and fully agreeing to all terms and conditions of this Agreement, including any and all changes, modifications or alterations that this Website may make to this Agreement from time to time and at any time.\n</br>1.3 After filling in the relevant information in accordance with the requirements of this Website, and going through other relevant procedures, you will successfully register yourself as a member of this Website (hereinafter referred to as \"Member\"); in the process of registration, if you click on the \"I Agree\", it shall be deemed that you have reached an agreement with the Company by way of electronic signature; or when you use this Website, you click on the \"I Agree\" button or a similar button, or if you use the services offered by this Website in any of the ways allowed by this Website, it shall be deemed that you fully understand, agree to and accept all the terms and conditions under this Agreement, and in this case, the absence of your handwritten signature will not affect the legal binding force that this Agreement may have on you\n</br>1.4 After you become a member of this Website, you will receive a member account and corresponding password, which shall be properly kept by you as a member of this Website; Members shall be liable for all activities and events carried out through their accounts.\n</br>1.5 You cannot engage in trading on the digital asset trading platform provided by this Website and gain access to the services that are exclusively available to members in accordance with the rules and regulations of this Website, unless and until you become a member of this Website; if you are not a member of this Website, you can only log in to and browse the Website and have access to other services as are permitted by the rules and regulations of this Website.\n</br>1.6 Upon registering yourself as a member of this Website and using any of the services and functions offered by this Website, it shall be deemed that you have read, understood this Agreement, and:\n</br>1.6.1 accepted to be bound by all terms and conditions of this Agreement;\n</br>1.6.2 You confirm that you have attained the age of 16, or another statutory age for entering into contracts as is required by a different applicable law, and your registration with this Website, purchase or sale via this Website, release information on this Website and other behaviors indicating your acceptance of the Services offered by this Website shall comply with the relevant laws and regulations of the sovereign state or region that has jurisdiction over you, and you confirm that you have sufficient capacity to accept these terms and conditions, enter into transactions and to use this Website for digital asset transactions.\n</br>1.6.3 You undertake that all your digital assets involved in transactions hereunder are legally acquired and owned by you.\n</br>1.6.4 You agree to undertake any and all liabilities for your own transaction and non-transaction activities as well as any and all profits and losses therefrom.\n</br>1.6.5 You confirm that the information provided at the time of registration is true and accurate.\n</br>1.6.6 You agree to comply with any and all relevant laws, including the reporting of any transaction profits for tax purposes.\n</br>1.6.7 You agree to always refrain from engaging in or participating in any act or activity that damages the interests of this Website or the Company, whether or not in connection with the Services provided by this Website.\n</br>1.6.8 This Agreement is only binding on the rights and obligations between you and us, and does not involve legal relations and legal disputes arising from and relating to the transaction of digital assets between the users of this Website, and between other websites and you.\n</br>2. Amendment of this Agreement\n</br>We reserve the right to amend this Agreement from time to time, and disclose such amendment by way of announcement on the Website without sending a separate notice to you on your rights. The date when the amendment is made will be indicated on the first page of the amended agreement. The amended agreement will take effect immediately upon announcement on the Website. You shall browse this Website from time to time and follow information on the time and content of amendments, if any, made to this Agreement. If you do not agree with the amendments, you shall stop using the services offered by this Website immediately; if you continue to use the services offered by this Website, it shall be deemed that you accept and agree to be bound by the amended agreement.\n</br>\n</br>3.Registration\n</br>3.1 Eligibility for Registration You confirm and promise that: you shall be a natural person, legal person or other organization with the ability to sign this Agreement and the ability to use the services of this Website, as is provided by applicable laws, when you complete the registration process or when you use the services offered by this Website in any other manner as is otherwise permitted by this Website. Upon clicking on the button indicating that you agree to register, it shall be deemed that you yourself or your authorized agent agrees to the content of this Agreement and your authorized agent will register with this Website and use the services offered by this Website on your behalf. If you are not a natural person, legal person or organization with the abovementioned ability, you and your authorized agent shall bear all the consequences of that, and the company reserves the right to cancel or permanently freeze your account and to hold you and your authorized agent accountable.\n</br>3.2 Purpose of Registration You confirm and promise that you do not register with this Website for the purpose of violating any of the applicable laws or regulations or undermining the order of digital asset transactions on this Website.\n</br>3.3 Registration Process\n</br>\n</br>3.3.1 You agree to provide a valid email address, a mobile phone number and other information in accordance with the requirements on the user registration page of this Website. You can use the email address, mobile phone number or any other manner permitted by this Website to log in to this Website. Where it is necessary and in accordance with the requirements of applicable laws and regulations of relevant jurisdictions, you shall provide your real name, identity card and other information required by applicable laws, regulations, the Terms of Privacy, and anti-money-laundering terms, and constantly update your registration data so that they will be timely, detailed and accurate as is required. All of the original typed data will be referenced as registration information. You shall be responsible for the authenticity, integrity and accuracy of such information and bear any direct or indirect loss and adverse consequences arising out of it.\n</br>3.3.2 If any of the applicable laws, regulations, rules, orders and other regulatory documents of the sovereign country or region in which you are based requires that mobile phone accounts must be based on real names, you hereby confirm that the mobile phone number you provide for registration purposes has gone through the real-name registration procedure. If you cannot provide such a mobile phone number as is required, any direct or indirect losses and adverse consequences arising therefrom and affecting you shall be borne by you.\n</br>3.3.3 After you provide the required registration information in a legal, complete and valid manner and such information passes relevant verification, you shall have the right to obtain an account and a password of this Website. Upon obtaining such account and password, your registration shall be deemed as successful and you can log into this Website as a member thereof.\n</br>3.3.4 You agree to receive emails and/or short messages sent by this Website related to the management and operation thereof.\n</br>4.Services\n</br>This Website only provides online transaction platform services for you to engage in digital asset trading activities through this Website (including but not limited to the digital asset transactions etc.). This Website does not participate in the transaction of digital assets as a buyer or seller; This Website does not provide any services relating to the replenishment and withdrawal of the legal currency of any country.\n</br>\n</br>4.1 Content of Services\n</br>\n</br>4.1.1 You have the right to browse the real-time quotes and transaction information of digital asset products on this Website, to submit digital asset transaction instructions and to complete the digital asset transaction through this Website.\n</br>4.1.2 You have the right to view information under the member accounts on this Website and to apply the functions provided by this Website.\n</br>4.1.3 You have the right to participate in the website activities organized by this Website in accordance with the rules of activities posted on this Website.\n</br>4.1.4 Other services that this Website promises to offer to you.\n</br>4.2 Service Rules You undertake to comply with the following service rules of this Website:\n</br>\n</br>4.2.1 You shall comply with the provisions of applicable laws, regulations, rules, and policy requirements, and ensure the legality of the source of all digital assets in your account, and shall refrain from engaging in any illegal activities or other activities that damages the rights and interests of this Website or any third party, such as sending or receiving information that is illegal, illicit or infringes on the rights and interests of any other person, sending or receiving pyramid scheme information or information or remarks causing other harms, unauthorized use or falsification of the email header information of this Website, inter alia.\n</br>4.2.2 You shall comply with applicable laws and regulations and properly use and keep your account in this Website and login password, password of your financial transactions, and the mobile phone number bound with your account that you provide upon registration of your account, as well as the security of the verification codes received via your mobile phone. You shall be solely responsible for any and all your operations carried out using your account with this Website and login password, financial transaction password, verification codes sent to your mobile phone, as well as all consequences of such operations. When you find that your account with this Website, your login password, financial transaction password, or mobile phone verification codes is used by any unauthorized third party, uncover any other problem relating to the security of your account, you shall inform this Website in a prompt and effective manner, and request this Website to temporarily suspend the services to your account with this Website. This Website shall have the right to take action on your request within a reasonable time; nonetheless, this Website does not bear any liability for the consequences that have arisen before such action is taken, including but not limited to any loss that you may sustain. You may not assign your account with this Website to any other person by way of donation, lending, leasing, transfer or otherwise without the consent of this Website.\n</br>4.2.3 You agree to take responsibility for all activities (including but not limited to information disclosure, information release, online click-approving or submission of various agreements on rules, online renewal of agreements or purchase service) using your account and password with this Website.\n</br>4.2.4 In your digital asset transactions on this Website, you may not maliciously interfere with the normal proceeding of the digital asset transaction or disrupt the transaction order; you may not use any technical means or other means to interfere with the normal operation of this Website or interfere with the other users\' use of the services; you may not maliciously defame the business goodwill of this Website on the ground of falsified fact.\n</br>4.2.5 If any dispute arises between you and any other user in connection with online transaction, you may not resort to any means other than judicial or governmental means to request this Website to provide relevant information.\n</br>4.2.6 All taxes payable as well as all fees relating to hardware, software and services that are incurred by you in the course of using the services provided by this Website shall be solely borne by you.\n</br>4.2.7 You shall abide by this Agreement and other terms of service and operating rules that this Website may release from time to time, and you have the right to terminate your use of the services provided by this Website at any time.\n</br>4.3 Product Rules\n</br>\n</br>4.3.1 Rules for trading products You undertake that in the process in which you log into this Website and engage in transactions with other users through this Website, you will properly comply with the following transaction rules.\n</br>4.3.1.1 Browsing transaction information When you browse the transaction information on this Website, you should carefully read all the content in the transaction information, including but not limited to the price, consignment, handling fee, buying or selling direction, and you shall accept all the contents contained in the transaction information before you may click on the button to proceed with the transaction.\n</br>4.3.1.2 Submission of Commission After browsing and verifying the transaction information, you may submit your transaction commissions. After you submit the transaction commission, it shall be deemed that you authorize this Website to broker you for the corresponding transactions, and this Website will automatically complete the matchmaking operation when there is a transaction proposal that meets your price quotation, without prior notice to you.\n</br>4.3.1.3 Accessing transaction details You can check the corresponding transaction records in the transaction statements by the Management Center, and confirm your own detailed transaction records.\n</br>4.3.1.4 Revoking/modifying transaction commission. You have the right to revoke or modify your transaction commission at any time before the transaction is concluded.\n</br>5.Rights and Obligations of this Website\n</br>5.1 If you do not have the registration qualifications agreed on in this Agreement, this Website shall have the right to refuse to allow you to register; if you have already registered, this Website shall have the right to revoke your member account, and this Website reserves the right to hold you or your authorized agent accountable. Furthermore, this Website reserves the right to decide whether to accept your application for registration under any other circumstances.\n</br>5.2 When this Website finds at its sole discretion that you or your associated account user is not suitable for high-risk investment, this Website shall have the right to suspend or terminate the use of your account and all associated accounts thereof.\n</br>5.3 When this Website finds out that the user of an Account is not the initial registrant of that Account, it shall have the right to suspend or terminate the user\'s access to that Account.\n</br>5.4 Where by means of technical testing or manual sampling, among others, this Website reasonably suspects that the information you provide is wrong, untrue, invalid or incomplete, this Website shall have the right to notify you to correct or update the information, or suspend or terminate its supply of the services to you.\n</br>5.5 This Website shall have the right to correct any information displayed on this Website when it uncovers any obvious error in such information.\n</br>5.6 This Website reserves the right to modify, suspend or terminate the Services offered by this Website, at any time, and the right to modify or suspend the Service without prior notice to you; if this Website terminates one or more of the Services offered by this Website, such termination by this Website will take effect on the date of announcement of such termination on the Website.\n</br>5.7 This Website shall take necessary technical means and management measures to ensure the normal operation of this Website, and shall provide a necessary and reliable trading environment and transaction services, and shall maintain the order of digital assets trading.\n</br>5.8 If you fail to log into this Website using your member account number and password for an uninterrupted period of one year, this Website shall have the right to revoke your account. After your account is revoked, this Website shall have the right to offer the member name represented by such account to other applicants for membership.\n</br>5.9 This Website shall ensure the security of your digital assets by strengthening technical input and enhancing security precautions, and is under the obligation to notify you in advance of the foreseeable security risks in your account.\n</br>5.10 This Website shall have the right to delete all kinds of content and information which does not conform to laws and regulations or the rules of this Website at any time, and exercise of this right by this Website is not subject to a prior notice to you.\n</br>5.11 This Website shall have the right to, in accordance with the applicable laws, administrative regulations, rules, orders and other regulatory documents of the sovereign country or region where you are based, request to you for more information or data, and to take reasonable measures to meet the requirements of the local standards, and you have the obligation to provide proper assistance to such measures; this Website shall have the right to suspend or permanently terminate your access to this Website as well as part or all of the services offered by this Website.\n</br>6.Indemnity\n</br>6.1 Under any circumstance, our liability for your direct damage will not exceed the total cost incurred by your three (3) months\' use of services offered by this Website.\n</br>6.2 Shall you breach this Agreement or any applicable law or administrative regulation, you shall pay to us at least US$ Two million in compensation and bear all the expenses in connection with such breach (including attorney\'s fees, among others). If such compensation cannot cover the actual loss, you shall make up for the difference.\n</br>7. The Right to Injunctive Relief\n</br>Both you and we acknowledge that common law remedies for breach of agreement or possible breach of contract may be insufficient to cover all the losses that we sustain; therefore, in the event of a breach of contract or a possible breach of contract, the non-breaching party shall have the right to seek injunctive relief as well as all other remedies that are permitted under common law or equity.\n</br>\n</br>8.Limitation and Exemption of Liability\n</br>8.1 You understand and agree that under no circumstance will we be held liable for any of the following events:\n</br>\n</br>8.1.1 loss of income;\n</br>8.1.2 loss of transaction profits or contractual losses;\n</br>8.1.3 disruption of the business\n</br>8.1.4 loss of expected currency losses\n</br>8.1.5 loss of information\n</br>8.1.6 loss of opportunity, damage to goodwill or reputation\n</br>8.1.7 damage or loss of data;\n</br>8.1.8 cost of purchasing alternative products or services;\n</br>8.1.9 any indirect, special or incidental loss or damage arising from any infringement (including negligence), breach of contract or any other cause, regardless of whether or not such loss or damage may reasonably be foreseen by us, and regardless of whether or not we are notified in advance of the possibility of such loss or damage.\n</br>8.1.10 Items 8.1.1 to 8.1.9 are independent of each other.\n</br>8.2 You understand and agree that we shall not be held liable for any damages caused by any of the following events:\n</br>\n</br>8.2.1 Where we are properly justified in believing that your specific transactions may involve any serious violation or breach of law or agreement;\n</br>8.2.2 Where we are reasonably justified in believing that your conduct on this Website is suspected of being illegal or immoral;\n</br>8.2.3 The expenses and losses arising from the purchase or acquisition of any data, information or transaction, etc. through the services offered by this Website;\n</br>8.2.4 Your misunderstanding of the Services offered by this Website;\n</br>8.2.5 Any other losses related to the services provided by this Website, which cannot be attributed to us.\n</br>8.3 Where we fail to provide the Services or delay in providing such Services due to information network equipment maintenance, information network connectivity failures, errors in computer, communications or other systems, power failures, weather conditions, unexpected accidents, industrial actions, labor disputes, revolts, uprisings, riots, lack of productivity or production materials, fires, floods, storms, explosions, wars, failure on the part of banks or other partners, collapse of the digital asset market, actions by government, judicial or administrative authorities, other acts that are not within our control or beyond our inability to control, or due to causes on the part of third parties, we shall not assume any responsibility for such failure to provide service or delay in providing services, or for the resultant loss you may sustain as a result of such failure or delay.\n</br>8.4 We cannot guarantee that all the information, programs, texts, etc. contained in this Website are completely safe, free from the interference and destruction by any malicious programs such as viruses, trojans, etc., therefore, your log-into this Website or use of any services offered by this Website, download of any program, information and data from this Website and your use thereof are your personal decisions and therefore you shall bear the any and all risks and losses that may possibly arise.\n</br>8.5 We do not make any warranties and commitments in connection with any of the information, products and business of any third party websites linked to this Website, as well as any other forms of content that do not belong to us; your use any of the services, information, and products provided by a third party website is your personal decision and therefore you shall assume any and all the responsibilities arising therefrom.\n</br>8.6 We do not make any explicit or implicit warranties regarding your use of the Services offered by this Website, including but not limited to the applicability, freedom from error or omission, consistency, accuracy, reliability, and applicability to a specific purpose, of the services provided by this Website. Furthermore, we do not make any commitment or guarantee in connection with the validity, accuracy, correctness, reliability, quality, stability, integrity and timeliness of the technology and information covered by the services offered by this Website. Whether to log in this Website or use the services provided by this Website is your personal decision and therefore you shall bear all the risks and possible losses arising from such decision. We do not make any explicit or implicit warranties in connection with the market, value and price of digital assets; you understand and acknowledge that the digital asset market is unstable, that the price and value of assets may fluctuate or collapse at any time, and that the transaction of digital assets is based on your personal free will and decision and therefore you shall assume any and all risks and losses that may possible arise therefrom.\n</br>8.7 The guarantees and undertakings specified in this Agreement shall be the only guarantee and statements that we make in connection with the Services provided by us under this Agreement and through this Website, and shall supersede any and all the warranties and commitments arising in any other way and manner, whether in writing or in words, express or implied. All these guarantees and statements represent only our own commitments and undertakings and do not guarantee any third party\'s compliance with the guarantees and commitments contained in this Agreement.\n</br>8.8 We do not waive any of the rights not mentioned in this Agreement and to the maximum extent permitted by the applicable law, to limit, exempt or offset our liability for damages.\n</br>8.9 Upon your registration of your account with this Website, it shall be deemed that you approve any and all operations performed by us in accordance with the rules set forth in this Agreement, and any and all risks arising from such operations shall be assumed by you.\n</br>9.Termination of Agreement\n</br>9.1 This Website shall have the right to terminate all Service offered by this Website to you in accordance with this Agreement, and this Agreement shall terminate on the date of termination of all services offered by this Website to you.\n</br>9.2 After the termination of this Agreement, you do not have the right to require this Website to continue to provide you with any service or perform any other obligation, including, but not limited to, requesting this Website to keep or disclose to you any information in your former original account, or to forward to you or any third party any information therein that is not read or sent.\n</br>9.3 The termination of this Agreement shall not prevent the observant party from demanding the breaching party to assume other liabilities.\n</br>10.Intellectual Property\n</br>10.1 All intellectual achievements included in this Website, including, but not limited to, website logos, databases, website design, text and graphics, software, photos, videos, music, sounds and any combinations of the aforementioned files, and the intellectual property rights of software compilation, associated source code and software (including small applications and scripts) shall be owned by this Website. You may not copy, modify, copy, transmit or use any of the foregoing materials or content for commercial purposes.\n</br>10.2 All rights contained in the name of this Website (including but not limited to business goodwill and trademarks, logos) shall be owned by the Company.\n</br>10.3 Upon accepting this Agreement, it shall be deemed that you, on the basis of your own free will, have transferred and assigned exclusively and free of charge to this Website all copyright of any form of information that you publish on this Website, including, but not limited to copyrights, distribution rights, lease rights, exhibition rights, performance rights, projection rights, broadcasting rights, information network dissemination rights, shooting rights, adaptation rights, translation rights, compilation rights and other transferable rights that copyright owners are entitled to, and this Website shall have the right to sue for any infringement on such copyright and obtain full compensation for such infringement. This Agreement shall apply to any content that is published by you on this Website and is protected by copyright law, regardless of whether the content is generated before or after the signing of this Agreement.\n</br>10.4 You shall not illegally use or dispose of the intellectual property rights of this Website or any other person during your use of the services offered by this Website. For any information that you publish on this Website, you may not publish or authorize other websites (or media) to use such information in any manner wuatsoever.\n</br>10.5 Your log into this Website or use of any of the services offered by this Website shall not be deemed as our transfer of any intellectual property to you.\n</br>11.Information protection\n</br>Regarding the collection and use of your personal information and storage protection, the privacy policy publicized on this website shall prevail.\n</br>\n</br>12.Calculation\n</br>All the transaction calculations are verified by us, and all the calculation methods have been posted on the Website, but we can not ensure that your use of this Website will not be disturbed or free from errors.\n</br>\n</br>13.Export Control\n</br>You understand and acknowledge that in accordance with relevant laws of the Republic of Seychelles, you shall not export, re-export, import or transfer any material (including software) on this Website; therefore, you hereby undertake that you will not voluntarily commit or assist or participate in any of the above export or related transfer or other violations of applicable laws and regulations; if you uncover any of the aforementioned events, you will report to us and assist us in handling them.\n</br>\n</br>14.Transfer\n</br>The rights and obligations agreed in this Agreement shall be equally binding on the assignees, the heirs, executors and administrators of the parties hereto who benefit from the rights and obligations. Without our consent, you may not transfer to any third party any of your rights or obligations hereunder, provided, however, we may, at any time, assign our rights and obligations under this Agreement to any third party with thirty (30) days\' notice to you.\n</br>\n</br>15.Severability\n</br>Severability If any provision of this Agreement is found unenforceable, invalid or illegal by any court of competent jurisdiction, validity of the remaining provisions of this Agreement shall not be affected.\n</br>\n</br>16.No Agency\n</br>Nothing in this Agreement shall be deemed to have created, implied or otherwise treated us as your agent, trustee or other representative, unless it is provided otherwise in this Agreement.\n</br>\n</br>17.Waiver\n</br>Our or your waiver of the right to hold the other party liable for breaches of agreement or any other liability as is agreed upon in this Agreement shall not be construed or deemed as a waiver of the right to hold the other party for other breaches of contract; a failure to exercise any right or remedy shall not be construed in any way as a waiver of such right or remedy.\n</br>\n</br>18.Headings\n</br>All headings herein are exclusively for the convenience of wording and are not intended to to expand or limit the content or scope of the terms and conditions of this Agreement.\n</br>\n</br>19.Applicable Law\n</br>This Agreement in its entirety is a contract concluded under the laws of the Republic of Seychelles, and relevant laws of the Republic of Seychelles shall apply to its establishment, interpretation, content and enforcement; Any claims or actions arising out of or relating to the Services agreed in this Agreement shall be governed and interpreted and enforced in accordance with the laws of the Republic of Seychelles. For the avoidance of doubt, this Clause shall be expressly applicable to any tort claim against us. The competent court or forum for any claim or action against us or in relation to us shall be in the Republic of Seychelles. You have unconditional access to exclusive jurisdiction in court proceedings and appeals in the courts of the Republic of Seychelles. You also unconditionally agree that the venue or competent court for any dispute or problem relating to this Agreement or any claim and proceeding arising from this Agreement shall be exclusively in the Republic of Seychelles. If any other business of this Website is subject to any special agreement on jurisdiction, such agreement shall prevail. The Doctrine of Forum Non Conveniens does not apply to the court of choice under these Terms of Service.\n</br>\n</br>20.Entry into Force and Interpretation of the Agreement\n</br>20.1 This Agreement shall enter into force when you click through the registration page of this Website, complete the registration procedures, obtain your account number and password of this Website, and shall be binding on you and this Website\n</br>20.2 The ultimate power of interpretation of this Agreement shall be vested in this Website.\n</br>Know-your-customers and Anti-Money Laundering Policies Preamble\n</br>1.1 We ensure that we comply with know-your-customer and anti-money-laundering laws and regulations, and will not knowingly violate know-your-customers and anti-money-laundering policies. To the extent of our reasonable control, we will adopt necessary measures and technology to provide you with Services that are safe and secure, so as to protect you against the loss caused by money laundering to the greatest extent possible.\n</br>1.2 Our know-your-customer and anti-money-laundering policies are a comprehensive system of international policies, including the know-your-customer and anti-money-laundering policies of the jurisdictions to which you are subject to. Our robust compliance framework ensures that we meet regulatory requirements and regulatory standards on both the local and global levels, and ensure the operational sustainability of our website.\n</br>Content of Our Know-Your-Customer and Anti-Money-Laundering Policies\n</br>2.1 We promulgate and update know-your-customers and anti-money-laundering policies to meet the standards set by relevant laws and regulations;\n</br>2.2 We promulgate and update some of the guidelines and rules in connection with the operation of this Website, and our staff will provide you whole-process service in accordance with the guidelines and rules;\n</br>2.3 We design and complete the procedures for internal monitoring and transaction control, such as rigorous identity authentication procedures, and form a professional team responsible for anti-money laundering;\n</br>2.4 We adopt risk-prevention-based approach to carry out due diligence and continuous supervision in connection with customers;\n</br>2.5 Review and regularly inspect existing transactions;\n</br>2.6 To report suspicious transactions to the competent authorities;\n</br>2.7 Proof documents of identity documents, address certificates and transaction records will be maintained for at least six(6) years; if they are submitted to the regulatory authorities, let it be understood that a separate notice will not be provided to you;\n</br>2.8 Credit cards are prohibited throughout the course of the transaction;\n</br>Identity Information and the Verification and Confirmation Thereof\n</br>3.1 Identity Information\n</br>\n</br>3.1.1 In accordance with the laws and regulations of relevant jurisdictions and in light of the nature of entities concerned, the content of your information as is collected by us may vary, and in principle, we will collect the following information of yours if you register as an individual: Basic personal information: your name, address (and permanent address, if the two are different), date of birth and nationality, and other information available. Identity authentication shall be based on documents issued by the official or other similar authorities, such as passports, identity cards or other identity documents as are required and issued by relevant jurisdictions. The address you provide will be validated in an appropriate manner, such as checking the fare ticket of means of transportation you use, your interest rate bills, or voter register. Valid photo: before you register, you must provide a photograph showing you holding your identity document in front of your chest; Contact information: telephone/mobile phone number and valid email address.\n</br>3.1.2 If you are a company or any other type of legal entity, we will collect the following information of yours to determine the final beneficiary of your account or your trust account. Your corporation enrollment and registration certificates of the company; a copy of the articles of association and memorandum of the company; the detailed certification materials of the ownership structure and ownership description of the company, and the decision of the board of directors on designating the authorized agent of the company responsible for the opening and execution of the account of the company with the website; the identity documents of the directors, major shareholders of the company as well as the authorized signatory for the company\'s account with the website, as are required to be provided in accordance with relevant rules; the company\'s main business address, and the company\'s mailing address if it is different from the main business address of the company. If the local address of the company is different from its main business address, the company shall be deemed to be a high-risk customer, and consequently the company will be required to provide additional documentation. Other certification documents, documents issued by competent authorities and other documents we may deem necessary in light of the laws and regulations of relevant jurisdictions and in light of the specific nature of your entity.\n</br>3.1.3 We only accept English and Chinese versions of your identity information; if your identity information is not in either of the two languages, you shall have your identity information translated into English and duly notarized.\n</br>3.2 Confirmation and Verification\n</br>\n</br>3.2.1 You are required to provide both the front and back sides of your identity documents.\n</br>3.2.2 You are required to provide us with a photograph showing you holding your identity documents in front of your chest.\n</br>3.2.3 Copies of certification documents shall be checked against the originals thereof. Nonetheless, if a trusted and suitable certifier person can prove that such copies are accurate and comprehensive duplicates of the originals thereof, such copies shall be deemed as acceptable. Such certifiers include ambassadors, members of the judiciary, magistrates, etc.\n</br>3.2.4 The identification the ultimate beneficiary and controller of the account shall be based on the determination of which individuals ultimately own or control the direct customer and/or to determining that the ongoing transaction is performed by another person. If you are a business enterprise, the identity of major shareholders thereof (for example, those holding 10 % or more of the voting equity in such business enterprise) shall be verified. Generally, a shareholder holding 25 % of the shares of the company will be deemed as involving an average level of risk, and the identity of the shareholder shall be verified; a shareholder holding 10 % or more of the voting rights or shares is deemed to be involving a high level of risk, and the identity of the shareholder shall be verified.\n</br>Transaction Supervision\n</br>4.1 We constantly set and adjust daily trading and cash withdrawal limits based on security requirement and actual state of transactions;\n</br>4.2 If the transaction occurs frequently in an account registered by you or is beyond reasonable circumstances, our professional team will assess and determine whether such transaction is suspicious;\n</br>4.3 If we identify a specific transaction as suspicious on the basis of our assessment, we may adopt such restrictive measures as suspending the transaction or denying the transaction, and if it is possible, we may even reverse the transaction as soon as possible, and report to the competent authorities, without, however, notifying you;\n</br>4.4 We reserve the right to reject registration applications by applicants that do not comply with the international standards against money laundering or who may be regarded as political and public figures; we reserve the right to suspend or terminate a transaction identified as suspicious based on our own assessment, which, however, does not breach any of our obligations and duties to you.', '2023-08-12 23:09:34', 'system', 'en', '001');
INSERT INTO `t_cms` VALUES ('1719455457845325826', '充币说明', '</br>\n·如果您已完成存款，請點擊頁面上的「我已存款」按鈕並提交收據，否則存款無法過帳。\n</br>\n·USDT儲值僅支援簡單寄送方式，其他方式（全部寄送）儲值暫時無法過帳。 敬請諒解。\n</br>\n·您向上述地址充值後，需要確認全網路節點後才能到帳。\n</br>\n·請確保您的電腦和瀏覽器安全，防止資訊被竄改或外洩。\n</br>\n·以上儲值地址為平台官方收款地址，請認準平台官方儲值地址，因儲值錯誤造成的經費損失需自行負擔\n</br>', '2023-11-01 04:45:02', 'info', 'CN', '002');
INSERT INTO `t_cms` VALUES ('1719456366541287425', '充币说明', '</br>\n·입금을 완료하신 경우 해당 페이지의 \\\"입금했습니다\\\" 버튼을 클릭하신 후 영수증을 제출해 주시기 바랍니다. 그렇지 않으면 입금이 게시되지 않습니다.\n</br>\n·USDT 입금은 간편송금 방식만 지원하며, 기타 방식(전체전송)으로 입금하는 경우 일시적으로 입금이 불가능합니다. 이해해주세요.\n</br>\n·위 주소로 충전하신 후, 전체 네트워크 노드를 확인하셔야 적립이 가능합니다.\n</br>\n·정보가 변조되거나 유출되지 않도록 컴퓨터와 브라우저가 안전한지 확인하십시오.\n</br>\n·위 입금 주소는 플랫폼의 공식 입금 주소입니다. 플랫폼의 공식 입금 주소를 찾아주세요. 잘못된 입금으로 인한 자금 손실은 본인이 부담해야 합니다.\n</br>', '2023-11-01 04:48:38', 'info', 'Korean', '002');
INSERT INTO `t_cms` VALUES ('1719456689704022018', '充币说明', '<br>\n・入金が完了している場合は、ページ内の「入金しました」ボタンをクリックして領収書を提出してください。入金しないと入金できません。\n<br>\n・USDT入金は簡易送金のみ対応しており、他の方法（一括送金）による入金は一時的に行うことができません。 ご理解ください。\n<br>\n·上記のアドレスにリチャージした後、クレジットされる前にネットワーク ノード全体を確認する必要があります。\n<br>\n・情報の改ざんや漏洩などを防ぐため、お使いのパソコンやブラウザが安全であることをご確認ください。\n<br>\n・上記の入金アドレスはプラットフォームの公式支払いアドレスです。プラットフォームの公式入金アドレスを探してください。誤った入金による資金の損失は自己負担となります。\n<br>', '2023-11-01 04:49:55', 'info', 'Japanese', '002');
INSERT INTO `t_cms` VALUES ('4028abaf7166c7230513552bd365639', 'คำอธิบายเกี่ยวกับอัตราค่าธรรมเนียม', 'อัตราค่าธรรมเนียมการซื้อขายสัญญา| <br>•ค่าธรรมเนียมการเปิดโพซิชั่นสำหรับการซื้อขายสัญญา：0.02% <br>•อัตราส่วนมาร์จิ้นของสัญญา：0.25% <br>•ไม่มีค่าธรรมเนียมในการปิดโพซิชั่นสำหรับการซื้อขายสัญญา <br> <br>อัตราค่าธรรมเนียมในการทำธุรกรรมฝากเงินและถอนเงิน| <br>•ค่าธรรมเนียมในการถอนเงิน：2% <br>•ไม่มีค่าธรรมเนียมในการฝากเงิน <br> <br>คำอธิบายอัตราค่าธรรมเนียมอื่น ๆ | <br>•ไม่มีค่าธรรมเนียมในการโอนเงินระหว่างบัญชี/แลกเงิน<br>•ไม่มีค่าธรรมเนียมในการซื้อสกุลเงิน แต่มีค่าธรรมเนียมในการขายสกุลเงิน：1%', '2020-07-17 21:31:53', 'help_center', 'th', '017');
INSERT INTO `t_cms` VALUES ('4028abaf7166c723051364e2bd365633', '充币说明', '</br>\n·หากคุณฝากเงินเรียบร้อยแล้ว โปรดคลิกปุ่ม \\\"ฉันได้ฝากเงินแล้ว\\\" บนหน้าเว็บและส่งใบเสร็จรับเงิน ไม่เช่นนั้นจะไม่สามารถโพสต์การฝากเงินได้\n</br>\n·การฝาก USDT รองรับเฉพาะวิธีการส่งแบบง่ายเท่านั้น และการฝากเงินโดยใช้วิธีอื่น (ส่งทั้งหมด) ไม่สามารถโพสต์ได้ชั่วคราว โปรดเข้าใจ.\n</br>\n·หลังจากที่คุณเติมเงินไปยังที่อยู่ข้างต้นแล้ว คุณต้องยืนยันโหนดเครือข่ายทั้งหมดก่อนจึงจะเครดิตได้\n</br>\n·โปรดตรวจสอบให้แน่ใจว่าคอมพิวเตอร์และเบราว์เซอร์ของคุณปลอดภัยเพื่อป้องกันข้อมูลจากการถูกดัดแปลงหรือรั่วไหล\n</br>\n·ที่อยู่การฝากเงินข้างต้นคือที่อยู่การชำระเงินอย่างเป็นทางการของแพลตฟอร์ม โปรดมองหาที่อยู่การฝากเงินอย่างเป็นทางการของแพลตฟอร์ม และการสูญเสียเงินที่เกิดจากการฝากไม่ถูกต้องจะต้องรับผิดชอบเอง\n</br>', '2020-07-17 12:44:48', 'info', 'th', '002');
INSERT INTO `t_cms` VALUES ('4028abaf7166c723051364e2bd365634', '提币说明', '·คุณสามารถถอนเงินได้ตลอด 24 ชั่วโมง <br>·ปัจจุบันสามารถถอนได้เฉพาะสกุลเงินUSDTเท่านั้น <br>·หลังจากส่งใบสมัครถอนเงินแล้ว  กองทุนของคุณจะขึ้นสถานะถูกระงับชั่วคราว เนื่องจากอยู่ระหว่างการดำเนินการถอนเงิน  ซึ่งระหว่างนี้ระบบจะเป็นผู้จัดการกองทุนของคุณ แต่ไม่ได้หมายความว่าคุณกำลังสูญเสียสินทรัพย์หรือสินทรัพย์เกิดความผิดปกติแต่อย่างใด<br>·คุณจะได้รับเงินภายใน 12 ชั่วโมงหลังจากส่งใบสมัครถอนเงิน  หากคุณไม่ได้รับเงินภายในเวลาที่กำหนดโปรดติดต่อฝ่ายบริการลูกค้าออนไลน์', '2020-07-17 12:56:31', 'info', 'th', '003');
INSERT INTO `t_cms` VALUES ('4028abaf7166c723051364e2bd365636', 'เหตุใดมูลค่าของสินทรัพย์ที่ถูกแปลงเป็นเงินถึงเปลี่ยนไป', '·สินทรัพย์สกุลเงินดิจิทัลที่คุณถือครองอยู่ในปัจจุบันจะถูกแปลงเป็นสกุลเงินดอลลาร์สหรัฐ  โดยมูลค่าของสินทรัพย์จะขึ้นลงตามความผันผวนของตลาดหลักทรัพย์  แต่จำนวนของสินทรัพย์ของคุณจะไม่มีการเปลี่ยนแปลง', '2020-07-17 20:51:56', 'help_center', 'th', '014');
INSERT INTO `t_cms` VALUES ('4028abaf7166c723051364e2bd365637', 'ลิมิตออร์เดอร์และมาร์เก็ตออร์เดอร์คืออะไร?', '·ลิมิตออร์เดอร์หมายถึง คำสั่งซื้อขายอนุพันธ์ที่ผู้ลงทุนส่งให้แก่โบรกเกอร์อนุพันธ์ เพื่อดำเนินการซื้อขายโดยทันที ณ ราคาที่กำหนดไว้หรือดีกว่า<br>·มาร์เก็ตออร์เดอร์ หมายถึง คำสั่งซื้อขายอนุพันธ์ที่ผู้ลงทุนส่งให้แก่โบรกเกอร์อนุพันธ์ เพื่อดำเนินการซื้อขายโดยทันที ณ ราคาที่ดีที่สุดในตลาดขณะนั้น <br>· ในเงื่อนไขคำสั่งเปิดตำแหน่ง   มาร์เก็ตออร์เดอร์จะได้รับการดำเนินการก่อนลิมิตออร์เดอร์  หากคุณเลือกลิมิตออร์เดอร์  โปรดเปิดตำแหน่งตามมาตรฐานราคาตลาดสกุลเงินในปัจจุบัน <br>', '2020-07-17 20:55:49', 'help_center', 'th', '015');
INSERT INTO `t_cms` VALUES ('4028abaf7166c723051364e2bd365638', 'เหตุใดต้องทำการโอนเงินระหว่างสองบัญชีภายใต้ชื่อเดียวกัน', '·เพื่อให้ทุกบัญชีของคุณมีอิสระทางการเงินมากขึ้น  ซึ่งจะช่วยให้คุณสามารถควบคุมความเสี่ยงได้ จึงต้องมีการแบ่งบัญชีโมดูลการซื้อขายหลัก<br>·การโอนเงินระหว่างสองบัญชี หมายถึง กระบวนการแปลงสินทรัพย์ระหว่างบัญชีเทรดต่างๆ<br>', '2020-07-17 21:01:03', 'help_center', 'th', '016');
INSERT INTO `t_cms` VALUES ('4028abaf7166c723051364e2bd365641', 'เงื่อนไขสัญญาฟิวเจอร์สคืออะไร?', '•ประเภทสัญญาฟิวเจอร์ส<br> <br>คำสั่งเปิดโพซิชั่น Long (ขาขึ้น) หมายถึง เทรดเดอร์กำลังส่งคำสั่งซื้อสินค้านั้น ๆ โดยคาดหวังว่าราคากำลังจะถีบตัวสูงขึ้นไปอีก  และจะทำการปิดสถานะนี้เพื่อขายสินค้าและได้กำไรจากส่วนต่างของราคาที่สูงขึ้น<br> <br>คำสั่งเปิดโพซิชั่น Short (ขาลง) หมายถึง เทรดเดอร์กำลังส่งคำสั่งขายสินค้านั้น ๆ ไปก่อน โดยคาดหวังว่าราคาสินค้านั้นจะปรับตัวลง และจะทำการปิดสถานะเพื่อซื้อคืนสินค้าที่ได้ทำการขายไปก่อนหน้าและทำกำไรจากส่วนต่างของช่วงราคาที่ปรับตัวลง<br> <br>•วิธีการสั่งซื้อ<br> <br>ลิมิตออเดอร์ : คุณต้องระบุราคาและปริมาณการสั่งซื้อ<br> <br>มาร์เก็ตออเดอร์ : คุณระบุแค่ปริมาณการสั่งซื้อ ส่วนราคาจะเป็นราคาที่ดีที่สุดในตลาด<br> <br>•การถือโพซิชั่น<br>เมื่อคุณส่งคำขอเปิดโพซิชั่นกับโบรกเกอร์สำเร็จ จะเรียกว่า การถือโพซิชั่น <br> <br>•ปัญหาสัญญาครบกำหนด: สัญญาแพลตฟอร์มเป็นสัญญาถาวร ไม่มีวันครบกำหนด ตราบใดที่เทรดเดอร์ไม่ได้ละเมิดเงื่อนไขการชำระบัญชีของระบบหรือไม่ได้ปิดโพซิชั่นด้วยตนเอง เทรดเดอร์ก็ยังคงสามารถถือครองตำแหน่งได้ตลอดไป<br> <br>·การปิดตำแหน่ง<br>ระบบจะปิดโพซิชั่นโดยอัตโนมัติเมื่อถึงค่าที่กำหนด Take Profit (ทำกำไร) และ Stop Loss (หยุดการขาดทุน)<br>ระบบบังคับให้ปิดโพซิชั่นเนื่องจากความเสี่ยงสูงเกินไป', '2020-07-17 21:44:34', 'help_center', 'th', '018');
INSERT INTO `t_cms` VALUES ('4028abaf7166c723051364e2bd3ar633', '充币说明', '</br>\n·إذا كنت قد أكملت الإيداع، يرجى النقر فوق الزر \\\"لقد قمت بالإيداع\\\" في الصفحة وإرسال الإيصال، وإلا فلن يتم نشر الإيداع.\n</br>\n· يدعم إيداع USDT فقط طريقة الإرسال البسيطة، ولا يمكن نشر الإيداع باستخدام طرق أخرى (إرسال الكل) مؤقتًا. من فضلك إفهم.\n</br>\n·بعد إعادة الشحن إلى العنوان المذكور أعلاه، يتعين عليك تأكيد عقدة الشبكة بالكامل قبل أن تتمكن من إضافتها.\n</br>\n·يرجى التأكد من أن جهاز الكمبيوتر والمتصفح الخاص بك آمنان لمنع التلاعب بالمعلومات أو تسريبها.\n</br>\n· عنوان الإيداع أعلاه هو عنوان الدفع الرسمي للمنصة، يرجى البحث عن عنوان الإيداع الرسمي للمنصة، وستتحمل بنفسك خسارة الأموال الناجمة عن الإيداع غير الصحيح\n</br>', '2020-07-17 12:44:48', 'info', 'ar', '002');
