INSERT INTO `t_cms` VALUES ('4028abaf7166c723051364e2bd3vi733', '充币说明', '</br>\n·Nếu bạn đã hoàn tất việc gửi tiền, vui lòng nhấp vào nút \\\"Tôi đã gửi tiền\\\" trên trang và gửi biên lai, nếu không khoản tiền gửi sẽ không thể được đăng.\n</br>\n· Tiền gửi USDT chỉ hỗ trợ phương thức gửi đơn giản và tiền gửi bằng các phương thức khác (gửi tất cả) không thể được đăng tạm thời. Làm ơn hãy hiểu.\n</br>\n·Sau khi nạp tiền vào địa chỉ trên, bạn cần xác nhận toàn bộ nút mạng trước khi có thể ghi có.\n</br>\n·Hãy đảm bảo rằng máy tính và trình duyệt của bạn được an toàn để tránh thông tin bị giả mạo hoặc rò rỉ.\n</br>\n·Địa chỉ gửi tiền ở trên là địa chỉ thanh toán chính thức của nền tảng, vui lòng tìm địa chỉ gửi tiền chính thức của nền tảng và việc mất tiền do gửi tiền không chính xác sẽ do bạn chịu\n</br>', '2020-07-17 12:44:48', 'info', 'vi', '002');
INSERT INTO `t_cms` VALUES ('4028abaf7166c723051364e2Italy634', '提币说明', '', '2020-07-17 12:56:31', 'info', 'Italy', '003');
