INSERT INTO `t_cms` VALUES ('4028abaf7166c723051364e2Italy733', '充币说明', '</br>\n·Se hai completato il deposito, fai clic sul pulsante \\\"Ho depositato\\\" nella pagina e invia la ricevuta, altrimenti il deposito non potrà essere registrato.\n</br>\n·Il deposito USDT supporta solo il metodo di invio semplice e il deposito utilizzando altri metodi (invia tutto) non può essere pubblicato temporaneamente. Per cortesia comprendi.\n</br>\n·Dopo aver effettuato la ricarica all\'indirizzo sopra indicato, è necessario confermare l\'intero nodo della rete prima che possa essere accreditato.\n</br>\n·Assicurati che il tuo computer e il tuo browser siano sicuri per evitare che le informazioni vengano manomesse o divulgate.\n</br>\n·L\'indirizzo di deposito sopra riportato è l\'indirizzo di pagamento ufficiale della piattaforma, cerca l\'indirizzo di deposito ufficiale della piattaforma e la perdita di fondi causata da un deposito errato sarà a tuo carico\n</br>', '2020-07-17 12:44:48', 'info', 'Italy', '002');
INSERT INTO `t_cms` VALUES ('4028abaf7166c723051364e2Italy745', 'Về phí xử lý', ' </br>\r\nTỷ lệ hợp đồng | </br>\r\n• Phí mở giao dịch hợp đồng: 3% </br>\r\n• Không có phí giao dịch khi đóng hợp đồng </br>\r\nTỷ giá giao dịch tiền tệ | </br>\r\n• Phí rút tiền: 1% </br>\r\n• Không tính phí ký gửi </br>\r\nDeion của các mức giá khác | </br>\r\nKhông có phí chuyển khoản khi chuyển / trao đổi tài khoản', '2020-07-17 21:29:11', 'help_center', 'vi', '017');
INSERT INTO `t_cms` VALUES ('4028abaf7166c72305146455bd365634', 'ฉันจะซื้อขายสัญญาฟิวเจอร์ได้อย่างไร?', '·คุณสามารถทำการซื้อขายสัญญาฟิวเจอร์ได้โดยการคาดคะเนแนวโน้ม(ขึ้นลง)ของราคาซื้อขายในปัจจุบัน  ซึ่งเมื่อคุณชำระบัญชีจะไม่มีการคำนวณช่วงความผันผวนของราคา  แต่จะคำนวณกำไรจากผลลัพธ์ของราคาที่ขึ้นลงเท่านั้น<br>·เวลาชำระบัญชีที่แตกต่างกันจะทำให้ได้รับเปอร์เซ็นต์กำไรที่แตกต่างกันด้วย คุณสามารถดูกำไรที่ได้รับในหน้าการซื้อขาย <br>', '2020-07-17 20:42:59', 'help_center', 'th', '012');
INSERT INTO `t_cms` VALUES ('4028abaf7166c72305146483bd366643', '关于我们', '', '2020-07-19 19:48:38', 'system', 'th', '020');
INSERT INTO `t_cms` VALUES ('4028abaf7166c7230524648ebd676652', 'คำอธิบายเกี่ยวกับการบังคับให้ปิดโพซิชั่น', '•ความเสี่ยง เป็นดัชนีวัดความผันผวนของสินทรัพย์ของคุณ  เมื่อความเสี่ยงเท่ากับ 100%  โพซิชั่นของคุณถือเป็น Stop out(พอร์ตล่ม)  ซึ่งระดับความเสี่ยง = (มาร์จิ้น/ส่วนของบัญชีสัญญา)*100%  เพื่อป้องกันไม่ให้ผู้ใช้สวมตำแหน่ง ระบบจะกำหนดอัตราส่วนการปรับความเสี่ยง เมื่อความเสี่ยงถึงค่าความเสี่ยงที่ระบบกำหนด  ระบบจะบังคับให้เทรดเดอร์ปิดโพซิชั่น 0 <br> <br>•ตัวอย่างเช่น : อัตราส่วนการปรับที่ระบบกำหนด คือ 10% เมื่อความเสี่ยงของคุณมากกว่าหรือเท่ากับ 90%  โพซิชั่นทั้งหมดของคุณจะถูกบังคับปิด<br> <br>•หมายเหตุ: หากระบบบังคับให้ปิดโพซิชั่นเนื่องจากมีความเสี่ยงสูงเกินไป  นั่นหมายถึงเทรดเดอร์จะต้องปิดโพซิชั่นทั้งหมดที่มี  ดังนั้นเทรดเดอร์จะต้องพยายามควบคุมความเสี่ยงของตัวเองอย่างเหมาะสม เพื่อหลีกเลี่ยงความสูญเสียโดยไม่จำเป็น', '2020-07-17 22:09:41', 'help_center', 'th', '019');
INSERT INTO `t_cms` VALUES ('4028abaf7166c72306632g54bd365631', '关于我们', '', '2020-07-19 19:48:38', 'system', 'fr', '020');
INSERT INTO `t_cms` VALUES ('4028abaf7166c72306632g54bd365632', '充币说明', '</br>\n·Si vous avez effectué le dépôt, veuillez cliquer sur le bouton « J\'ai déposé » sur la page et soumettre le reçu, sinon le dépôt ne pourra pas être comptabilisé.\n</br>\n·Le dépôt USDT ne prend en charge que la méthode d\'envoi simple, et le dépôt utilisant d\'autres méthodes (tout envoyer) ne peut pas être publié temporairement. Essaye de comprendre.\n</br>\n·Après avoir rechargé à l\'adresse ci-dessus, vous devez confirmer l\'intégralité du nœud du réseau avant de pouvoir le créditer.\n</br>\n·Veuillez vous assurer que votre ordinateur et votre navigateur sont sécurisés pour éviter que les informations ne soient falsifiées ou divulguées.\n</br>\n· L\'adresse de dépôt ci-dessus est l\'adresse de paiement officielle de la plateforme, veuillez rechercher l\'adresse de dépôt officielle de la plateforme, et la perte de fonds causée par un dépôt incorrect sera à votre charge.\n</br>', '2020-07-17 12:44:48', 'info', 'fr', '002');
INSERT INTO `t_cms` VALUES ('4028abaf7166c72306632g54bd365633', '提币说明', '</br>1: le temps de retrait est de 24 heures, vous pouvez soumettre 3 demandes de retrait par jour (retrait minimum 100 USDT, retrait maximum 70 000 USDT)\r\n</br>2: actuellement, le retrait ne prend en charge que la monnaie USDT, et le type de lien de portefeuille est ERC2O! 3: après présentation de la demande de retrait, les fonds sont gelés parce que le retrait est en cours et que les fonds sont temporairement gérés par le système. Ça ne veut pas dire que vous avez perdu cet actif ou que cet actif est anormal. 4: arrivée dans les 12 heures suivant la présentation de la demande de retrait. Si vous n’arrivez pas après le délai d’attente prévu, veuillez consulter le service client en ligne.', '2020-07-17 12:56:31', 'info', 'fr', '003');
INSERT INTO `t_cms` VALUES ('4028abaf7166c72306632g54bd365634', 'Quelles sont les règles du commerce à terme?', '• participer à la transaction en estimant la transaction courante à la prochaine tendance des prix (up et \r down), et la fourchette des up et down n’est pas calculée au cours du règlement, et seuls les résultats des up et down sont réglés en recettes. </br> \r\n• le pourcentage de bénéfice réglé à différentes livraisons \r\ntimes est différent, et le bénéfice sera exactement \r naffiché dans l’interface de négociation. \r\n', '2020-07-17 20:42:59', 'help_center', 'fr', '012');
INSERT INTO `t_cms` VALUES ('4028abaf7166c72306632g54bd365635', 'Pourquoi le montant converti en actifs change-t-il?', '• la conversion des actifs est la valeur de la monnaie numérique actuelle détenue en dollars, qui change en raison des fluctuations du prix des actifs numériques. Le nombre de vos actifs numériques n’a pas changé.', '2020-07-17 20:55:49', 'help_center', 'fr', '014');
INSERT INTO `t_cms` VALUES ('4028abaf7166c72306632g54bd365636', 'Que sont les ordreslimite et les ordres du marché?', '• l’ordre du marché se rapporte à: la plateforme confiée se négocie directement au prix du marché. • dans les règles d’open trading, le système donne la priorité aux ordres du marché. Si vous choisissez un ordre-limite, veuillez ouvrir la position en fonction du prix du marché en monnaie courante.', '2020-07-17 20:55:49', 'help_center', 'fr', '015');
INSERT INTO `t_cms` VALUES ('4028abaf7166c72306632g54bd365637', 'Sur les frais de manutention', 'Taux de négociation à terme | </br>\r\n• commission de négociation à terme: 2%  </br>\r\n• pas de frais de dépôt </br>\r\nDeion des autres taux.0 commission d’ouverture de transaction: 3% </br>\r\n• coefficient de marge du contrat: 0,25% </br>\r\n• pas de commissions de transaction pour la clôture du contrat </br>\r\n0 frais de retrait: 1% </br>Pas de frais de transfert pour transfert/échange de compte.', '2020-07-17 21:31:53', 'help_center', 'fr', '017');
INSERT INTO `t_cms` VALUES ('4028abaf7166c72306632g54bd365638', 'Quelles sont les règles du contrat?', '• Transaction Type </br>\r\n acheter long (bullish) signifie que vous pensez que l’indice \r\n\r ncourant est susceptible d’augmenter, et que vous souhaitez acheter un \r\ncertain nombre de certains contrats au prix que vous \r\nset ou au prix du marché actuel. </br> </br>\r\n\r\n la vente à découvert (bearish) signifie que vous pensez que \r\n l’indice actuel est susceptible de baisser, et vous vous attendez à vendre \r\n certain nombre de certains contrats au prix que vous \r\nset ou au prix du marché actuel. </br>\r\n• Order Method </br> </br>\r\n\r\n Limit Order: vous devez spécifier le prix et la quantité de la commande. </br> </br>\r\n\r\n ordre du marché: il suffit de définir l’ordre \r nquantité, et le prix est le prix actuel du marché. \r\n• ouverture de la Position lorsque vous soumettez une commande d’ouverture de la Position \r\na, elle est appelée une Position. </br>\r\n• problème de livraison du contrat: le contrat de la plateforme est un contrat \r nperpétuel, et il n’y a pas de délai de livraison défini. Tant que le système ne remplit pas les conditions pour la liquidation ou que vous ne fermez pas manuellement la position, vous pouvez la conserver en permanence. </br>\r\n• fermeture du système </br> </br>\r\n\r\n le système ferme automatiquement la position lorsque la valeur de prise de Profit et de perte d’arrêt est atteinte. </br> </br>\r\n\r\n le risque est trop élevé et le système est obligé de fermer la position.', '2020-07-17 21:44:34', 'help_center', 'fr', '018');
INSERT INTO `t_cms` VALUES ('4028abaf7166c72306632g54bd365639', 'Notes sur la liquidation forcée', '• le degré de risque est un indicateur qui mesure le risque de vos actifs. Lorsque le degré de risque est égal à \r\n100%, votre position est considérée comme une liquidation. Le \r ndegré de risque = (marge de détention/actions) * 100%. Le taux d’ajustement du degré de risque est \r\nset. Lorsque le degré de risque atteint la valeur de risque fixée par le système, celui-ci force la liquidation. </br>\r\n• par exemple, si le taux d’ajustement fixé par le système \r\n est de 10%, lorsque votre niveau de risque est supérieur ou \r égal à 90%, toutes vos positions seront contraintes d’être fermées par le système. </br>\r\n• Note: si le système est forcé de fermer la position\r nen raison d’un risque excessif, il fermera toutes vos positions, donc \r\nI espère que vous pouvez raisonnablement contrôler votre risque pour éviter \r ndes pertes inutiles.', '2020-07-17 22:09:41', 'help_center', 'fr', '019');
INSERT INTO `t_cms` VALUES ('4028abaf7166c7h5ufh364e2bd365631', '关于我们', '', '2020-07-19 19:48:38', 'system', 'es', '020');
INSERT INTO `t_cms` VALUES ('4028abaf7166c7h5ufh364e2bd365632', '充币说明', '</br>\n·Si ha completado el depósito, haga clic en el botón \\\"He depositado\\\" en la página y envíe el recibo; de lo contrario, el depósito no se podrá registrar.\n</br>\n·El depósito en USDT solo admite el método de envío simple y el depósito que utiliza otros métodos (enviar todo) no se puede publicar temporalmente. Por favor entiende.\n</br>\n·Después de recargar a la dirección anterior, debe confirmar todo el nodo de la red antes de que se pueda acreditar.\n</br>\n·Asegúrese de que su computadora y su navegador sean seguros para evitar que la información sea manipulada o filtrada.\n</br>\n·La dirección de depósito anterior es la dirección de pago oficial de la plataforma, busque la dirección de depósito oficial de la plataforma y la pérdida de fondos causada por un depósito incorrecto correrá por su cuenta\n</br>', '2020-07-17 12:44:48', 'info', 'es', '002');
INSERT INTO `t_cms` VALUES ('4028abaf7166c7h5ufh364e2bd365633', '提币说明', '1: el tiempo de retiro es de 24 horas, puede presentar 3 solicitudes de retiro por día (retiro mínimo de 100 USDT, retiro máximo de 70.000 USDT)\r\n</br>2: en la actualidad, el retiro sólo es compatible con la moneda USDT, y el tipo de enlace Wallet es ERC2O! \r\n</br>3: después de presentar la solicitud de retiro, los fondos se encuentran congelados porque el retiro está en curso y los fondos son administrados temporalmente por el sistema. No significa que haya perdido este activo o que el activo sea anormal. \r\n</br>4: llegada dentro de las 12 horas después de presentar la solicitud de retiro. Si no llega después del plazo previsto, consulte el servicio de atención al cliente online.', '2020-07-17 12:56:31', 'info', 'es', '003');
INSERT INTO `t_cms` VALUES ('4028abaf7166c7h5ufh364e2bd365634', '¿Cuáles son las reglas del comercio de futuros?', '• participar en la transacción mediante la estimación de la transacción \r ncorriente a la siguiente tendencia de precios (subidas y baj), y el rango de subidas y bajno se \r\ncalcula durante la liquidación, y sólo los resultados \r nde las subidas y bajse se liquidan en ingresos. \r\n• el porcentaje de beneficio establecido en diferentes entregas \r\ntimes es diferente, y el beneficio será exactamente \r\n mostrado en la interfaz de negociación. \r\n', '2020-07-17 20:42:59', 'help_center', 'es', '012');
INSERT INTO `t_cms` VALUES ('4028abaf7166c7h5ufh364e2bd365635', '¿Por qué cambia la cantidad convertida en activos?', '• la conversión de activos es el valor de la moneda \r\ndigital actual en dólares, que cambia debido a las fluctuaciones \r\n en el precio de los activos digitales. El número \r nde sus activos digitales no ha cambiado.', '2020-07-17 20:42:59', 'help_center', 'es', '014');
INSERT INTO `t_cms` VALUES ('4028abaf7166c7h5ufh364e2bd365636', '¿Qué son las órdenes límite y las órdenes de mercado?', '• la orden de límite se refiere a: encomendar la plataforma a negociar al precio que especifique <br>\r\n• la orden de mercado se refiere a: la plataforma confiada \r nnegocia directamente al precio de mercado actual. \r\n• en las reglas de negociación abierta, el sistema dará prioridad a las órdenes \r\nmarket. Si elige una orden de límite, por favor abra \r nla posición razonablemente basada en el precio actual de la moneda \r\nmarket.', '2020-07-17 20:55:49', 'help_center', 'es', '015');
INSERT INTO `t_cms` VALUES ('4028abaf7166c7h5ufh364e2bd365637', 'Acerca de las tas de gestión tas de negocición de futuros →', ' r  n tas de negocición de futuros : 2 % < / br > Ntasa de contrato → r  nla de apertura de la trans Acción de contrato : 0,02 % < / br >  r  nata de margen de contrato : 0,25 % < / br > Nata de trans Acción de transfèrements de futuros : 2 % < / br >  r  nla de retiro : 1 % > > >  r  n sin cargo por depósito >  r > Ndeion de otras tasas → r  nno tasas de transferación para transferación de cuenta / intercambio', '2020-07-17 21:31:53', 'help_center', 'es', '017');
INSERT INTO `t_cms` VALUES ('4028abaf7166c7h5ufh364e2bd365638', '¿Cuáles son las reglas del contrato comercial?', '• tipo de transacción </br>\r\n comprar largo (alcista) significa que usted piensa que el índice \r\n\r\ncurrent es probable que aumente, y que desea comprar un número \r ndeterminado de ciertos contratos al precio que \r\nset o el precio de mercado actual. </br> </br>\r\n\r\n vender a corto (bajista) significa que usted piensa que \r nel índice actual es probable que caiga, y espera vender \r\na cierto número de ciertos contratos al precio que \r\nset o el precio de mercado actual. </br>\r\n• método de orden </br> </br>\r r\n orden límite: es necesario especificar el precio y \r ncantidad de la orden. </br> </br>\r\n\r\n orden de mercado: sólo necesita establecer la cantidad de orden \r n, y el precio es el precio de mercado actual. \r\n• apertura de posición cuando se envía una orden para abrir una posición \r\na, se llama posición. \r\n• problema de entrega por contrato: el contrato de plataforma es un contrato \r nperpetu, y no hay un tiempo de entrega establecido. \r\nAs siempre y cuando el sistema no cumpla las condiciones \r npara la liquidación o no cierre manualmente la \r nposición, puede mantener la posición de forma permanente. </br>\r\n• cierre del sistema </br> </br>\r\n el sistema cierra automáticamente la posición cuando \r\n se alcanza el valor establecido de Take Profit y Stop Loss. </br> </br>\r\n\r\n el riesgo es demasiado alto y el sistema se ve obligado a \r ncerrar la posición.', '2020-07-17 21:44:34', 'help_center', 'es', '018');
INSERT INTO `t_cms` VALUES ('4028abaf7166c7h5ufh364e2bd365639', 'Notas sobre la liquidación forzada', '• el grado de riesgo es un indicador para medir el riesgo \r nde sus activos. Cuando el grado de riesgo es igual a \r\n100%, su posición se considera una liquidación. El \r ngrado de riesgo = (margen de tenencia/cuenta de contrato \r equidad) * 100%. La razón de ajuste del grado de riesgo es \r\nset. Cuando el grado de riesgo alcanza el valor de riesgo establecido por \r nel sistema, el sistema forzará la liquidación. Por ejemplo, si la razón de ajuste establecida por el \r\nsystem es 10%, cuando su nivel de riesgo es mayor que o \r neigual al 90%, todas sus posiciones serán forzadas a ser \r ncerradas por el sistema. Nota: si el sistema se ve obligado a cerrar la posición \r\n debido a un riesgo excesivo, cerrará todas sus posiciones, por lo que \r\nI espera que pueda controlar razonablemente su riesgo para evitar \r nunpérdidas necesarias.', '2020-07-17 22:09:41', 'help_center', 'es', '019');
INSERT INTO `t_cms` VALUES ('4028abaf7236c7h5ufh364e2bd353435', 'Apa itu aset yang diblokirkan?', '•Aset yang dibekukan berarti ketika Anda melakukan transaksi atau operasi penarikan, prosesnya tidak sepenuhnya selesai, dan aset saat ini dikelola sementara oleh sistem dan tidak dapat dikontrol secara bebas oleh Anda. Ini tidak berarti bahwa Anda telah kehilangan aset atau ada ketidaknormalan pada aset tersebut. Mohon dimaklumkan.', '2020-07-17 20:42:59', 'help_center', 'ind', '013');
INSERT INTO `t_cms` VALUES ('4028abaf7236c7h5ufh364e2bd365337', 'Mengapa Anda perlu mentransfer dana?', '•Demi memastikan masing-masing dana antara berbagai akun Anda dan memfasilitasi kontrol risiko keamanan Anda, dengan begitu akun modul perdagangan utama dengan ini akan dibagi. <br>•Transfer mengacu pada proses saling konversi aset antara berbagai akun berdagang. <br>', '2020-07-17 21:31:53', 'help_center', 'ind', '016');
INSERT INTO `t_cms` VALUES ('4028abaf7236c7h5ufh364e2bd365631', '关于我们', '', '2020-07-19 19:48:38', 'system', 'ind', '020');
INSERT INTO `t_cms` VALUES ('4028abaf7236c7h5ufh364e2bd365632', '充币说明', '</br>\n·Jika Anda telah menyelesaikan penyetoran, silakan klik tombol \\\"Saya telah menyetor\\\" di halaman dan kirimkan tanda terima, jika tidak, penyetoran tidak dapat dikirim.\n</br>\n·Setoran USDT hanya mendukung metode pengiriman sederhana, dan setoran menggunakan metode lain (kirim semua) tidak dapat diposting sementara. Mohon mengertilah.\n</br>\n·Setelah Anda mengisi ulang ke alamat di atas, Anda perlu mengkonfirmasi seluruh node jaringan sebelum dapat dikreditkan.\n</br>\n·Harap pastikan komputer dan browser Anda aman untuk mencegah informasi dirusak atau dibocorkan.\n</br>\n·Alamat penyetoran di atas adalah alamat pembayaran resmi platform, silakan cari alamat penyetoran resmi platform, dan kehilangan dana yang disebabkan oleh kesalahan penyetoran akan ditanggung sendiri\n</br>', '2020-07-17 12:44:48', 'info', 'ind', '002');
INSERT INTO `t_cms` VALUES ('4028abaf7236c7h5ufh364e2bd365633', '提币说明', '•Waktu penarikan adalah 24 jam. <br>•Setelah mengajukan aplikasi penarikan, dana akan diblokir karena penarikan sedang berlangsung, dan dana akan dikelola dengan sistem, dan tidak berarti bahwa Anda akan kehilangan aset ini atau terjadi perubahan pada aset Anda. <br>•Setelah mengajukan permohonan penarikan, akun akan dikreditkan dalam waktu 12 jam. Jika akun tidak diterima setelah waktu penarikan yang diharapkan, harap konsultasikan dengan layanan pelanggan daring.', '2020-07-17 12:56:31', 'info', 'ind', '003');
INSERT INTO `t_cms` VALUES ('4028abaf7236c7h5ufh364e2bd365634', 'Apa aturan perdagangan berjangka?', '• Berpartisipasi dalam transaksi dengan memprediksi tren harga selanjutnya (Naik atau turun) dari metode perdagangan saat ini. Kisaran naik atau turun tidak dihitung selama proses penyelesaian, dan hanya hasil naik atau turun yang dapat dikalkulasikan. <br>• Persentase keuntungan dari penyelesaian waktu pengiriman berbeda, dan keuntungan akan ditampilkan secara akurat di antarmuka perdagangan. <br>', '2020-07-17 20:42:59', 'help_center', 'ind', '012');
INSERT INTO `t_cms` VALUES ('4028abaf7236c7h5ufh364e2bd365635', 'Mengapa jumlah yang dikonversi dalam aset dapat berubah?', '•Nilai mata uang digital yang dipegang saat ini dikonversi menjadi dolar AS ketika diubah menjadi sebuah aset, akan terjadi perubahan karena fluktuasi harga aset digital, tetapi jumlah aset digital Anda tidak akan berubah.', '2020-07-17 20:42:59', 'help_center', 'ind', '014');
INSERT INTO `t_cms` VALUES ('4028abaf7236c7h5ufh364e2bd365636', 'Apa yang dimaksud dengan limit order dan market order?', '•Pesanan batasan harga merujuk pada harga di mana platform melakukan transaksi sesuai dengan harga yang Anda tentukan. <br>•Pesanan pasar mengacu pada: Mempercayakan platform untuk melakukan transaksi langsung harga pasar saat ini. <br>•Dalam aturan perdagangan yang terbuka, pesanan pasar memiliki prioritas di atas batas pesanan. Jika Anda memilih limit order, silahkan buka posisi Anda secara wajar berdasarkan harga pasar mata uang saat ini. <br>', '2020-07-17 20:55:49', 'help_center', 'ind', '015');
INSERT INTO `t_cms` VALUES ('4028abaf7236c7h5ufh364e2bd365637', 'Catatan tarif', '•Harga Kontrak Transaksi| <br>•Biaya pembukaan kontrak transaksi: 3% <br>•Tidak ada biaya penanganan untuk penutupan dalam transaksi kontrak <br> <br>Tarif biaya transaksi deposit dan penarikan <br>• Penarikan biaya: 1% <br>• Tidak ada biaya yang dikenakan untuk penarikan<br><br>Petunjuk tarif lainnya| <br>• Tidak ada biaya penanganan untuk transfer/pertukaran akun <br>• Tidak ada biaya penanganan untuk pembelian mata uang, biaya penjualan mata uang: 1%', '2020-07-17 21:31:53', 'help_center', 'ind', '017');
INSERT INTO `t_cms` VALUES ('4028abaf7236c7h5ufh364e2bd365638', 'Apa aturan perdagangan kontrak?', '•Jenis transaksi <br> <br>Membeli panjang (Kenaikan) berarti Anda percaya bahwa indeks saat ini akan naik, dan berharap untuk membeli sejumlah kontrak tertentu dengan harga yang Anda tetapkan atau sesuai harga pasar saat ini. <br> <br>Menjual (Penurunan) berarti Anda percaya bahwa indeks saat ini mungkin turun, dan Anda berharap untuk menjual sejumlah kontrak tertentu dengan harga yang Anda tetapkan atau harga pasar saat ini. <br> <br>•Metode pesanan <br> <br>Limit order: Anda harus menentukan sendiri harga dan jumlah pesanan. <br> <br>Pesanan pasar: Anda hanya perlu mengatur jumlah pesanan, dan harganya adalah harga pasar pada saat ini. <br> <br>• Memegang posisi <br>Saat order untuk membuka posisi yang Anda kirimkan dieksekusi, itu disebut posisi. <br> <br>•Masalah pengiriman kontrak: Kontrak platform adalah kontrak yang bersifat permanen, dan tidak ada waktu pengiriman yang ditetapkan. Selama kondisi likuidasi , sistem tidak terpenuhi atau Anda tidak menutup posisi secara manual, Anda dapat menahan posisi tersebut secara permanen. <br> <br>•Sistem menutup posisi <br>Ketika nilai stop profit dan stop kerugian yang ditetapkan telah tercapai, maka sistem akan secara otomatis menutup posisi. <br>Karena risikonya terlalu tinggi, dan sistem memaksa untuk likuidasi.', '2020-07-17 21:44:34', 'help_center', 'ind', '018');
INSERT INTO `t_cms` VALUES ('4028abaf7236c7h5ufh364e2bd365639', 'Penjelasan tentang kewajiban likuidasi ', '•Tingkat risiko ini adalah indikator demi mengukur risiko aset Anda. Ketika tingkat risiko sama dengan 100%, maka posisi Anda dianggap sebagai likuidasi. Tingkat risiko = (Margin posisi/Ekuitas akun kontrak)*100%. Untuk mencegah pengguna dalam likuidasi, sistem menetapkan rasio penyesuaian tingkat risiko Anda, ketika tingkat risiko mencapai nilai risiko yang ditetapkan oleh sistem, maka sistem akan mewajibkan untuk likuidasi sebagi 0 <br> <br>•Misalnya: Rasio penyesuaian yang diatur oleh sistem adalah 10%, maka ketika tingkat risiko Anda lebih besar atau sama dengan 90%, maka semua posisi Anda akan ditutup secara paksa oleh sistem. <br> <br>• Catatan: Jika sistem memaksa likuidasi yang disebabkan oleh risiko yang berlebihan, maka semua posisi Anda akan ditutup, jadi kami berharap Anda dapat mengontrol risiko Anda secara wajar untuk menghindari kerugian yang tidak diperlukan.', '2020-07-17 22:09:41', 'help_center', 'ind', '019');
INSERT INTO `t_cms` VALUES ('4028abaf735bcb2e01735bd1c1cavi01', 'lệnh giới hạn', 'Một lệnh mua/bán ở một mức giá xác định hoặc tốt hơn.', '2020-07-17 16:09:00', 'info', 'vi', '004');
INSERT INTO `t_cms` VALUES ('4028abaf735bcb2e01735bd2901dvi02', 'đặt hàng ở siêu thị', 'Lệnh mua hoặc bán ngay tại giá thị trường hiện tại.', '2020-07-17 16:09:52', 'info', 'vi', '005');
INSERT INTO `t_cms` VALUES ('4028abaf735bcb2e01735bd325e2vi03', 'lệnh giới hạn dừng', 'Lệnh bán hoặc đóng một vị trí ở một mức giá đã định sau khi thị trường đạt đến một mức giá nhất định, được sử dụng để hạn chế thua lỗ.', '2020-07-17 16:10:31', 'info', 'vi', '006');
INSERT INTO `t_cms` VALUES ('4028abaf735bcb2e01735bd3f33fvi04', 'Lệnh chốt lời giới hạn', 'Tương tự như lệnh dừng giới hạn, nó cũng là lệnh bán hoặc đóng một vị trí ở một mức giá đã định sau khi thị trường đạt đến một mức giá cụ thể và được sử dụng để kiểm soát lợi nhuận.', '2020-07-17 16:11:23', 'info', 'vi', '007');
INSERT INTO `t_cms` VALUES ('4028abaf735bcb2e01735bd4830fvi05', 'lệnh dừng lỗ thị trường', 'Lệnh bán hoặc đóng một vị thế theo giá thị trường sau khi thị trường đạt đến một mức giá nhất định, được sử dụng để hạn chế thua lỗ.', '2020-07-17 16:12:00', 'info', 'vi', '008');
INSERT INTO `t_cms` VALUES ('4028abaf735bcb2e01735bd5afc1vi06', 'Lệnh chốt lời thị trường', 'Tương tự như lệnh dừng lỗ theo giá thị trường, nó cũng là một lệnh bán hoặc đóng vị thế theo giá thị trường sau khi thị trường đạt đến một mức giá nhất định, được sử dụng để kiểm soát lợi nhuận.', '2020-07-17 16:13:17', 'info', 'vi', '009');
INSERT INTO `t_cms` VALUES ('4028abaf735bcb2e01735bd699dfvi07', 'Biên độ mở là gì?', 'Giao dịch ký quỹ có nghĩa là bạn chỉ cần trả một tỷ lệ ký quỹ nhất định để mua và bán hợp đồng, theo bội số đòn bẩy đã chọn, tỷ lệ ký quỹ là bội số nhỏ hơn của giá trị hợp đồng. Anh ta có thể phóng đại lợi nhuận của bạn, nhưng nó cũng có thể khiến bạn gặp thêm rủi ro.', '2020-07-17 16:14:17', 'info', 'vi', '010');
INSERT INTO `t_cms` VALUES ('4028abaf735bcb2e01735bd7924dvi08', 'Thanh lý là gì và thanh lý là gì?', 'Khi số tiền còn lại trong tài khoản của bạn ít hơn lãi và lỗ thả nổi theo yêu cầu của hợp đồng giao dịch, vị thế của bạn sẽ bị đóng bởi sàn giao dịch, còn được gọi là thanh lý. Vì giá tại thời điểm đóng cửa được xác định theo giá thị trường, nên khi giá giao dịch cực kỳ bất lợi, tiền của bạn có thể không đủ để trả cho khoản lỗ của giao dịch, dẫn đến giá trị âm trong tài khoản của bạn. được gọi là mất vị trí.', '2020-07-17 16:15:21', 'info', 'vi', '011');
INSERT INTO `t_cms` VALUES ('4028abaf735cb19201735ccc9b14vi63', 'Các quy tắc của giao dịch tương lai là gì?', 'Tham gia giao dịch bằng cách dự đoán xu hướng giá tiếp theo (tăng và giảm) của cặp giao dịch hiện tại. Phạm vi tăng và giảm không được tính trong quá trình thanh toán và chỉ kết quả của các biến động tăng và giảm được sử dụng để thanh toán thu nhập. </br>\r\n·Tỷ lệ phần trăm lợi nhuận của việc thanh toán thời gian giao hàng khác nhau là khác nhau và lợi nhuận sẽ được hiển thị chính xác trong giao diện giao dịch. </br>', '2020-07-17 20:42:59', 'help_center', 'vi', '012');
INSERT INTO `t_cms` VALUES ('4028abaf735cb19201735cd18fa8vie6', 'Tài sản phong tỏa là gì?', '·Tài sản bị đóng băng có nghĩa là khi bạn thực hiện các giao dịch hoặc thao tác rút tiền, quá trình này chưa hoàn tất và tài sản hiện tại được hệ thống tạm thời quản lý và bạn không thể tùy ý kiểm soát. Điều đó không có nghĩa là bạn bị mất tài sản này hoặc có sự bất thường trong tài sản, hãy yên tâm.', '2020-07-17 20:48:24', 'help_center', 'vi', '013');
INSERT INTO `t_cms` VALUES ('4028abaf735cb19201735cd4ca4evic2', 'Tại sao số tiền quy đổi trong tài sản lại thay đổi', '·Giá trị của loại tiền kỹ thuật số hiện đang nắm giữ được chuyển đổi thành đô la Mỹ khi chuyển đổi thành tài sản sẽ thay đổi do biến động giá của tài sản kỹ thuật số. Số lượng tài sản kỹ thuật số của bạn không thay đổi.', '2020-07-17 20:51:56', 'help_center', 'vi', '014');
INSERT INTO `t_cms` VALUES ('4028abaf735cb19201735cd8588evi90', 'Lệnh giới hạn và lệnh thị trường là gì?', '·Lệnh giới hạn giá đề cập đến mức giá mà nền tảng thực hiện các giao dịch theo mức giá được chỉ định của bạn. </br>\r\nỦy thác giá thị trường đề cập đến: ủy thác cho nền tảng thực hiện các giao dịch trực tiếp theo giá thị trường hiện tại. </br>\r\n·Lệnh thị trường được ưu tiên hơn lệnh giới hạn trong các quy tắc giao dịch mở. Nếu bạn chọn một lệnh giới hạn, vui lòng mở một vị trí hợp lý dựa trên giá thị trường tiền tệ hiện tại. </br>', '2020-07-17 20:55:49', 'help_center', 'vi', '015');
INSERT INTO `t_cms` VALUES ('4028abaf735cb19201735d0779e17vib', 'Các quy tắc của giao dịch hợp đồng là gì?', '• Loại giao dịch </br>\r\n Mua lâu (tăng giá) có nghĩa là bạn nghĩ rằng\r\n\r\nchỉ số hiện tại có khả năng tăng và bạn muốn mua một\r\nmột số hợp đồng nhất định với mức giá bạn đặt hoặc giá thị trường hiện tại. </br> </br>\r\n\r\n Bán khống (giảm giá) có nghĩa là bạn nghĩ rằng\r\nchỉ số hiện tại có khả năng giảm và bạn dự kiến sẽ bán\r\na một số lượng nhất định hợp đồng ở mức giá bạn đặt hoặc giá thị trường hiện tại. </br>\r\n• Phương thức đặt lệnh</br> </br>\r\n\r\n Lệnh giới hạn: Bạn cần chỉ định giá và\r\nsố lượng của lệnh. </br> </br>\r\n\r\n Lệnh thị trường: Bạn chỉ cần đặt lệnh\r\nsố lượng, và giá là giá thị trường hiện tại.\r\n• Mở vị thế Khi bạn gửi một lệnh để mở\r\na vị trí, nó được gọi là một vị trí. </br>\r\n• Vấn đề phân phối hợp đồng: Hợp đồng nền tảng là\r\nhợp đồng vĩnh viễn và không có thời gian phân phối cố định.\r\nMiễn là hệ thống không đáp ứng các điều kiện\r\nđể thanh lý hoặc bạn không đóng\r\nvị thế theo cách thủ công, bạn có thể giữ vị thế vĩnh viễn. </br>\r\n• Đóng hệ thống </br> </br>\r\n\r\n Hệ thống tự động đóng vị thế khi\r\nđạt đến giá trị đã đặt của Chốt lãi và Cắt lỗ. </br> </br>\r\n\r\n Rủi ro quá cao và hệ thống buộc phải\r\nđóng vị thế.', '2020-07-17 21:47:17', 'help_center', 'vi', '018');
INSERT INTO `t_cms` VALUES ('4028abaf735cb19201735d1f46303vi9', 'Lưu ý về buộc thanh lý', '• Mức độ rủi ro là chỉ tiêu đo lường mức độ rủi ro của tài sản. Khi mức độ rủi ro bằng\r\n100%, vị thế của bạn được coi là thanh lý. \r\nMức độ rủi ro = (tỷ lệ nắm giữ / tài khoản hợp đồng\r\nequity) * 100%. Tỷ lệ điều chỉnh của mức độ rủi ro được\r\nđặt. Khi mức độ rủi ro đạt đến giá trị rủi ro do\r\nhệ thống đặt, hệ thống sẽ buộc thanh lý. </br>\r\n• Ví dụ: nếu tỷ lệ điều chỉnh do hệ thống\r\n đặt là 10%, khi mức độ rủi ro của bạn lớn hơn hoặc\rằng 90%, tất cả các vị trí của bạn sẽ buộc phải bị đóng bởi hệ thống. </br>\r\n• Lưu ý: Nếu hệ thống buộc phải đóng vị trí\r\ndo rủi ro quá mức, nó sẽ đóng tất cả các vị trí của bạn, vì vậy\r\nTôi hy vọng bạn có thể kiểm soát rủi ro của mình một cách hợp lý để tránh r\n những tổn thất không cần thiết.', '2020-07-17 22:13:17', 'help_center', 'vi', '019');
