INSERT INTO `t_cms` VALUES ('4028abaf8266d723051364e2b6425632', '提币说明', '·Die Auszahlungszeit beträgt 24 Stunden. <br>·Derzeit wird nur die USDT-Währung für Auszahlungen unterstützt. <br>·Nach Einreichung des Auszahlungsantrags werden die Gelder eingefroren, da die Auszahlung im Gange ist und die Gelder vorübergehend vom System verwaltet werden, was nicht bedeutet, dass Sie die Vermögenswerte verloren haben oder die Vermögenswerte anormal sind. <br>·Es wird innerhalb von 12 Stunden nach Einreichung des Auszahlungsantrags gutgeschrieben.', '2020-07-17 12:56:31', 'info', 'de', '003');
INSERT INTO `t_cms` VALUES ('4028abaf8266d723051364e2bd365621', '充币说明', '</br>\n·Wenn Sie die Einzahlung abgeschlossen haben, klicken Sie bitte auf der Seite auf die Schaltfläche „Ich habe eingezahlt“ und reichen Sie die Quittung ein, andernfalls kann die Einzahlung nicht gebucht werden.\n</br>\n·USDT-Einzahlungen unterstützen nur die einfache Sendemethode und die Einzahlung mit anderen Methoden (Alles senden) kann nicht vorübergehend gebucht werden. Bitte verstehe.\n</br>\n·Nachdem Sie an der oben genannten Adresse aufgeladen haben, müssen Sie den gesamten Netzwerkknoten bestätigen, bevor eine Gutschrift erfolgen kann.\n</br>\n·Bitte stellen Sie sicher, dass Ihr Computer und Browser sicher sind, um zu verhindern, dass Informationen manipuliert werden oder verloren gehen.\n</br>\n·Die oben genannte Einzahlungsadresse ist die offizielle Zahlungsadresse der Plattform. Bitte suchen Sie nach der offiziellen Einzahlungsadresse der Plattform. Der durch eine falsche Einzahlung verursachte Geldverlust muss von Ihnen selbst getragen werden\n</br>', '2020-07-17 12:44:48', 'info', 'de', '002');
INSERT INTO `t_cms` VALUES ('4028abaf8266d723051364e2bd365643', 'Welche Regeln gelten für den Futures-Handel?', '·Nehmen Sie an der Transaktion teil, indem Sie den nächsten Preistrend (aufwärts oder abwärts) des aktuellen Transaktionspaars schätzen.Die Bandbreite von Aufwärts- und Abwärtsbewegungen wird während der Abwicklung nicht berechnet, und nur die Ergebnisse von Aufwärts- und Abwärtsbewegungen werden abgerechnet. <br>·Der Prozentsatz des Gewinns, der zu unterschiedlichen Lieferzeiten abgerechnet wird, ist unterschiedlich, und der Gewinn wird in der Handelsschnittstelle genau angezeigt. <br>', '2020-07-17 20:42:59', 'help_center', 'de', '012');
INSERT INTO `t_cms` VALUES ('4028abaf8266d723051364e2bd365654', 'Was sind eingefrorene Vermögenswerte?', '·Eingefrorene Guthaben bedeutet, dass bei einer Transaktion oder Abhebung der Vorgang noch nicht abgeschlossen ist und das aktuelle Guthaben vorübergehend vom System verwaltet wird und von Ihnen nicht frei verwaltet werden kann. Dies bedeutet nicht, dass Sie den Vermögenswert verloren haben oder dass der Vermögenswert anormal ist, seien Sie versichert.', '2020-07-17 20:42:59', 'help_center', 'de', '013');
INSERT INTO `t_cms` VALUES ('4028abaf8266d723051364e2bd365665', 'Warum ändert sich der umgerechnete Betrag im Vermögenswert?', 'Der Wert der derzeit in US-Dollar gehaltenen digitalen Währung wird bei der Umrechnung der Vermögenswerte berechnet, die sich aufgrund von Preisschwankungen digitaler Vermögenswerte ändert. Die Menge Ihrer digitalen Assets hat sich nicht geändert.', '2020-07-17 20:42:59', 'help_center', 'de', '014');
INSERT INTO `t_cms` VALUES ('4028abaf8266d723051364e2bd365666', 'Was sind Limit Orders und Market Orders?', '·Limit Order bezieht sich auf den Preis, zu dem die Plattform gemäß Ihrem festgelegten Preis gehandelt wird. <br>·Market Order bezieht sich auf: Die Orderplattform handelt direkt zum aktuellen Marktpreis. <br>·In offenen Handelsregeln haben Market Orders Vorrang vor Limit Orders. Wenn Sie sich für eine Limit-Order entscheiden, öffnen Sie die Position bitte angemessen gemäß dem aktuellen Devisenmarktpreis. <br>', '2020-07-17 20:55:49', 'help_center', 'de', '015');
INSERT INTO `t_cms` VALUES ('4028abaf8266d723051364e2bd365667', 'Warum müssen Sie Geld überweisen?', '·Um die Unabhängigkeit der Mittel zwischen Ihren verschiedenen Konten zu gewährleisten und Ihnen zu helfen, eine angemessene Risikokontrolle durchzuführen, werden die Konten der wichtigsten Handelsmodule hiermit geteilt. <br>·Transfer bezieht sich auf den Prozess der gegenseitigen Umwandlung von Vermögenswerten zwischen verschiedenen Handelskonten. <br>', '2020-07-17 21:01:03', 'help_center', 'de', '016');
INSERT INTO `t_cms` VALUES ('4028abaf8266d723051364e2bd365668', 'Hinweis zu den Tarifen', 'Kontrakthandelskurse <br><br>• Eröffnungsgebühr für Vertragstransaktionen: 3 % <br>Transaktionsraten für Ein- und Auszahlungen| <br>•Abhebungsgebühr: 1 % <br>Zusätzliche Preisbeschreibung | <br>•Kontoübertrag/Umtausch kostenlos <br>• Beim Coin-Kauf fällt keine Bearbeitungsgebühr an Coin-Verkaufsgebühr: 1%', '2020-07-17 21:31:53', 'help_center', 'de', '017');
INSERT INTO `t_cms` VALUES ('4028abaf8266d723051364e2bd365669', 'Was sind die Regeln für den Kontrakthandel?', '•<br> <br>Long-Kauf (bullisch) bedeutet, dass Sie glauben, dass der aktuelle Index steigen könnte, und hoffen, eine bestimmte Menge eines bestimmten Kontrakts zu dem von Ihnen festgelegten Preis oder dem aktuellen Marktpreis kaufen zu können. <br> <br>Leerverkaufen (bärisch) bedeutet, dass Sie glauben, dass der aktuelle Index fallen könnte, und Sie erwarten, eine bestimmte Menge eines Kontrakts zu dem von Ihnen festgelegten Preis oder dem aktuellen Marktpreis zu verkaufen. <br> <br>• <br> <br>Limit-Order: Sie müssen den Preis und die Menge der Order selbst festlegen. <br> <br>Marktauftrag: Sie müssen nur die Auftragsmenge festlegen, und der Preis ist der aktuelle Marktpreis. <br> <br>•Position <br>Wenn die Order, die Sie zum Eröffnen einer Position übermitteln, erfüllt ist, wird dies als Position bezeichnet. <br> <br>• Vertragslieferproblem: Der Plattformvertrag ist ein unbefristeter Vertrag und es gibt keine festgelegte Lieferzeit. Solange das System die Liquidationsbedingungen nicht erfüllt oder Sie die Position nicht manuell schließen, können Sie die Position dauerhaft halten. <br> <br>·Systemschließung <br>Wenn der festgelegte Wert von Take Profit und Stop Loss erreicht ist, schließt das System die Position automatisch. <br>Wenn das Risiko zu hoch ist, erzwingt das System die Liquidation.', '2020-07-17 21:44:34', 'help_center', 'de', '018');
INSERT INTO `t_cms` VALUES ('4028abaf8266d723051364e2bd365672', 'Hinweise zur Zwangsliquidation', '•Risiko ist ein Maß für das Augenlid Ihres Vermögens, wenn das Risiko gleich 100 % ist, Ihre Position gilt als liquidiert und das Risikoniveau = (Positions-Margin / VertragskontoEigenkapital des Benutzers) * 100 %, um zu verhindern, dass Benutzer Positionen überschreiten, legt das System die Risikostufe festWenn der Risikograd den vom System festgelegten Risikowert erreicht, verstärkt das System die <br> <br>', '2020-07-17 22:09:41', 'help_center', 'de', '019');
