DROP TABLE IF EXISTS `t_c2c_advert`;
CREATE TABLE `t_c2c_advert`  (
  `uuid` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '主键id',
  `c2c_user_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '承兑商id',
  `direction` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '买卖方式：buy买/sell卖',
  `currency` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '支付币种',
  `symbol` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '上架币种',
  `symbol_close` double NOT NULL DEFAULT 0 COMMENT '上架币种实时行情价',
  `pay_rate` double NOT NULL DEFAULT 0 COMMENT '支付比率',
  `pay_type` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '支付方式配置id列表：不同id逗号分隔',
