  `investment_max` double NOT NULL DEFAULT 0 COMMENT '单笔订单最高限额',
  `deposit` double NOT NULL DEFAULT 0 COMMENT '剩余派单金额',
  `deposit_open` double NOT NULL DEFAULT 0 COMMENT '派单金额',
