  `transaction_terms` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '交易条款',
  `order_msg` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '订单自动消息',
  `remark` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`uuid`) USING BTREE,
  INDEX `index_c2c_user_id`(`c2c_user_id`) USING BTREE,
  INDEX `index_direction`(`direction`) USING BTREE,
  INDEX `index_currency`(`currency`) USING BTREE,
  INDEX `index_symbol`(`symbol`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = 'c2c广告表' ROW_FORMAT = COMPACT;

