  `thirty_days_amount` double NOT NULL DEFAULT 0 COMMENT '30日交易量',
  `buy_amount` double NOT NULL DEFAULT 0 COMMENT '买交易量',
  `sell_amount` double NOT NULL DEFAULT 0 COMMENT '卖交易量',
  `total_amount` double NOT NULL DEFAULT 0 COMMENT '总交易量',
