  `exchange_users` int(11) NOT NULL DEFAULT 0 COMMENT '交易人数',
  `buy_success_orders` int(11) NOT NULL DEFAULT 0 COMMENT '买成单数',
  `sell_success_orders` int(11) NOT NULL DEFAULT 0 COMMENT '卖成单数',
  `total_success_orders` int(11) NOT NULL DEFAULT 0 COMMENT '总成单数',
  `appraise_good` int(11) NOT NULL DEFAULT 0 COMMENT '好评数',
  `appraise_bad` int(11) NOT NULL DEFAULT 0 COMMENT '差评数',
  `order_mail_notice_open` int(2) NOT NULL DEFAULT 0 COMMENT '订单邮件通知：0关闭/1打开',
  `order_sms_notice_open` int(2) NOT NULL DEFAULT 0 COMMENT '订单短信通知：0关闭/1打开',
  `order_app_notice_open` int(2) NOT NULL DEFAULT 0 COMMENT '订单app通知：0关闭/1打开',
  `appeal_mail_notice_open` int(2) NOT NULL DEFAULT 0 COMMENT '申诉邮件通知：0关闭/1打开',
  `appeal_sms_notice_open` int(2) NOT NULL DEFAULT 0 COMMENT '申诉短信通知：0关闭/1打开',
  `appeal_app_notice_open` int(2) NOT NULL DEFAULT 0 COMMENT '申诉app通知：0关闭/1打开',
  `chat_app_notice_open` int(2) NOT NULL DEFAULT 0 COMMENT '聊天app通知：0关闭/1打开',
  `security_mail_notice_open` int(2) NOT NULL DEFAULT 0 COMMENT '安全邮件通知：0关闭/1打开',
  `security_sms_notice_open` int(2) NOT NULL DEFAULT 0 COMMENT '安全短信通知：0关闭/1打开',
  `security_app_notice_open` int(2) NOT NULL DEFAULT 0 COMMENT '安全app通知：0关闭/1打开',
  `remark` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`uuid`) USING BTREE,
  INDEX `index_c2c_user_type`(`c2c_user_type`) USING BTREE,
  INDEX `index_c2c_user_code`(`c2c_user_code`) USING BTREE,
  INDEX `index_c2c_user_party_id`(`c2c_user_party_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = 'c2c承兑商表' ROW_FORMAT = COMPACT;

