DROP TABLE IF EXISTS `t_loan_order`;
CREATE TABLE `t_loan_order`  (
  `uuid` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键',
  `order_no` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单号',
  `party_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户id',
  `order_type` int(1) NOT NULL DEFAULT 1 COMMENT '订单类型: 1 借款;2新增质押;3续借;4还款;5强平结清',
  `state` int(1) NOT NULL DEFAULT 0 COMMENT '订单状态: 1计息中;2已结清;3强平结清;4已逾期',
  `loan_currency` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '贷款币种',
  `pledge_currency` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '质押的币种',
  `pledge_amount` double NOT NULL COMMENT '质押金额',
  `pledge_rate` double NOT NULL DEFAULT 0 COMMENT '质押率%',
  `pledge_type` int(1) NOT NULL DEFAULT 1 COMMENT '质押类型:1币质押',
  `loan_amount` double NOT NULL DEFAULT 0 COMMENT '总借款',
  `debt_amount` double NOT NULL DEFAULT 0 COMMENT '总负债',
  `interest_amount` double NOT NULL DEFAULT 0 COMMENT '总利息',
  `overdue_amount` double NOT NULL DEFAULT 0 COMMENT '总逾期',
  `hourly_rate` double NOT NULL DEFAULT 0 COMMENT '时利率',
  `overdue_rate` double NOT NULL DEFAULT 0 COMMENT '逾期时利率',
  `loan_cycle` int(2) NOT NULL COMMENT '借款周期',
  `create_time` datetime(0) NOT NULL COMMENT '借款时间',
  `expire_time` datetime(0) NOT NULL COMMENT '到期时间',
  PRIMARY KEY (`uuid`) USING BTREE,
  INDEX `index_party_id`(`party_id`) USING BTREE,
  INDEX `index_state_create_time`(`state`, `create_time`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '借币订单表' ROW_FORMAT = COMPACT;

