  `maxmun_interval` bigint(20) NULL DEFAULT NULL COMMENT '最大下单间隔,单位秒',
  `minmun_interval` bigint(20) NULL DEFAULT NULL COMMENT '最小下单间隔,单位秒',
  `maxmun_num` double(10, 5) NULL DEFAULT NULL COMMENT '最大下单数量',
  `minmun_num` double(10, 5) NULL DEFAULT NULL COMMENT '最小下单数量',
  `money` double(20, 5) NULL DEFAULT NULL COMMENT '机器人资金',
  `minmuan_amount` double(10, 5) NULL DEFAULT NULL COMMENT '最小交易量',
  `random1` double(10, 5) NULL DEFAULT NULL,
  `random2` double(10, 5) NULL DEFAULT NULL,
  `random3` double(10, 5) NULL DEFAULT NULL,
  `random4` double(10, 5) NULL DEFAULT NULL,
  `random5` double(10, 5) NULL DEFAULT NULL,
  `random6` double(10, 5) NULL DEFAULT NULL,
  `price_decimals` bigint(10) NULL DEFAULT NULL COMMENT '价格精度',
  `num_decimals` bigint(10) NULL DEFAULT NULL COMMENT '数量精度',
  `maxum_price_diff` double(10, 5) NULL DEFAULT NULL COMMENT '买卖最高差价',
  `buy_num` double(10, 5) NULL DEFAULT NULL COMMENT '买单数量',
  `sell_num` double(10, 5) NULL DEFAULT NULL COMMENT '卖单数量',
  `high_frequency` double(10, 5) NULL DEFAULT NULL COMMENT '高频量比',
  `low_frequency` double(10, 5) NULL DEFAULT NULL COMMENT '低频量比',
  `weight` double(10, 5) NULL DEFAULT NULL COMMENT '权重',
  `running_status` bigint(10) NULL DEFAULT NULL COMMENT '运行状态',
  `follow_market` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '跟随大盘',
  `market_increase` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '大盘涨幅',
  `multiple` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '扩大倍数',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '修改时间',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `item` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `username` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '机器人账号',
  `password` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '机器人密码-显示用'
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

