  `PROFIT_RATIO` double NULL DEFAULT NULL COMMENT '累计收益率',
  `ORDER_PROFIT` int(11) NULL DEFAULT NULL COMMENT '累计盈利笔数',
  `ORDER_LOSS` int(11) NULL DEFAULT NULL COMMENT '累计亏损笔数',
  `ORDER_SUM` int(11) NULL DEFAULT NULL COMMENT '累计交易笔数',
  `FOLLOWER_SUM` int(11) NULL DEFAULT NULL COMMENT '累计跟随人数',
