  `FOLLOWER_NOW` int(11) NULL DEFAULT NULL COMMENT '当前跟随人数',
  `FOLLOWER_MAX` int(11) NULL DEFAULT NULL COMMENT '此次跟单最多跟随人数',
  `STATE` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '状态（是否开启跟单）---STATE,0为未开启，1为开启',
  `CREATE_TIME` datetime(0) NULL DEFAULT NULL COMMENT '入驻时间',
  `IMG` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '头像图片',
