  `ORDER_AMOUNT` double NULL DEFAULT 0 COMMENT '累计金额',
  `WEEK_3_ORDER_SUM` int(11) NULL DEFAULT 0 COMMENT '3周交易笔数',
  `WEEK_3_ORDER_PROFIT` int(11) NULL DEFAULT 0,
  `DEVIATION_PROFIT` double NULL DEFAULT 0 COMMENT '累计收益-偏差',
  `DEVIATION_ORDER_AMOUNT` double NULL DEFAULT 0 COMMENT '累计金额-偏差',
  `DEVIATION_PROFIT_RATIO` double NULL DEFAULT 0 COMMENT '累计收益率-偏差',
  `DEVIATION_ORDER_PROFIT` double NULL DEFAULT 0 COMMENT '累计盈利笔数-偏差',
  `DEVIATION_ORDER_LOSS` double NULL DEFAULT 0 COMMENT '累计亏损笔数-偏差',
  `DEVIATION_ORDER_SUM` double NULL DEFAULT 0 COMMENT '累计交易笔数-偏差',
  `DEVIATION_FOLLOWER_SUM` double NULL DEFAULT 0 COMMENT '累计跟随人数-偏差',
  `DEVIATION_FOLLOWER_NOW` double NULL DEFAULT 0 COMMENT '当前跟随人数-偏差',
  `DEVIATION_WEEK_3_PROFIT` double NULL DEFAULT 0 COMMENT '3周收益偏差',
  `DEVIATION_WEEK_3_ORDER_AMOUNT` double NULL DEFAULT 0 COMMENT '3周累计金额-偏差',
  `DEVIATION_WEEK_3_PROFIT_RATIO` double NULL DEFAULT 0 COMMENT '3周收益率-偏差',
  `DEVIATION_WEEK_3_ORDER_PROFIT` double NULL DEFAULT 0 COMMENT '3周盈利笔数-偏差',
  `DEVIATION_WEEK_3_ORDER_SUM` double NULL DEFAULT 0 COMMENT '3周交易笔数-偏差',
  `FOLLOW_VOLUMN_MIN` int(11) NULL DEFAULT 0 COMMENT '跟单最小下单数',
  `CREATE_TIME_TS` int(11) NULL DEFAULT NULL,
  `UPDATE_TIME_TS` int(11) NULL DEFAULT NULL,
  `UPDATE_BY` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
