  INDEX `INDEX_TRADER_STATE`(`STATE`) USING BTREE,
  INDEX `INDEX_TRADER_PROFIT_STATE`(`PROFIT`, `STATE`) USING BTREE,
  INDEX `INDEX_TRADER_PROFIT_RATIO_STATE`(`PROFIT_RATIO`, `STATE`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = COMPACT;

