DROP TABLE IF EXISTS `tz_user`;
CREATE TABLE `tz_user`  (
  `user_id` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'ID',
  `user_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户名',
  `real_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '真实姓名',
  `user_mail` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户邮箱',
  `login_password` varchar(150) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '登录密码',
  `safe_password` varchar(150) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '资金密码',
  `user_mobile` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '手机号码',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '修改时间',
  `create_time` datetime(0) NOT NULL COMMENT '创建时间',
  `user_regip` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '注册IP',
  `user_lasttime` datetime(0) NULL DEFAULT NULL COMMENT '最后登录时间',
  `user_lastip` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '最后登录IP',
  `google_auth_bind` tinyint(1) NULL DEFAULT NULL COMMENT '谷歌验证器是否绑定',
  `google_auth_secret` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT 'M' COMMENT '谷歌验证码密钥',
  `user_recom` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '推荐人',
  `role_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '角色',
  `status` int(1) NOT NULL DEFAULT 1 COMMENT '状态 1 正常 0 无效',
  `user_code` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户编号',
  `mail_bind` tinyint(1) NULL DEFAULT 0 COMMENT '邮箱绑定',
  `user_mobile_bind` tinyint(1) NULL DEFAULT 0 COMMENT '手机绑定',
  `real_name_authority` tinyint(1) NULL DEFAULT 0 COMMENT '实名认证',
  `highlevel_authority` tinyint(1) NULL DEFAULT 0 COMMENT '高级认证',
  `user_level` int(11) NULL DEFAULT 1 COMMENT '会员等级',
  `withdraw_limit_amount` decimal(30, 8) NULL DEFAULT NULL COMMENT '当日提现限制金额',
  `withdraw_limit_now_amount` decimal(30, 8) NULL DEFAULT NULL COMMENT '当前可用提现流水',
  `withdraw_authority` tinyint(1) NULL DEFAULT 1 COMMENT '提现权限',
  `remarks` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  `enabled` tinyint(1) NULL DEFAULT NULL,
  `login_authority` tinyint(1) NULL DEFAULT NULL,
  `c2c_user_type` int(1) NULL DEFAULT NULL,
  `gift_money_flag` tinyint(1) NULL DEFAULT NULL,
  `gift_user` tinyint(1) NULL DEFAULT NULL,
  PRIMARY KEY (`user_id`) USING BTREE,
  UNIQUE INDEX `ud_user_mail`(`user_mail`) USING BTREE,
  UNIQUE INDEX `ud_user_unique_mobile`(`user_mobile`) USING BTREE,
  UNIQUE INDEX `user_code`(`user_code`) USING BTREE,
  INDEX `create_time`(`create_time`) USING BTREE,
  INDEX `role_name`(`role_name`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户表' ROW_FORMAT = Dynamic;

